(1, '{\"94\":{\"cate_parent\":\"Electricals \",\"cate_main\":\"lighting\",\"cate_list\":\"decorative and party \",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"81\",\"cate_mid\":\"92\"}}', '', 'Curtain String Lights', 'http://dragonmartguide.com/images/products/2_Curtain_String_Lights1.jpg', '[\"http://dragonmartguide.com/images/products/3_Curtain_String_Lights2.jpg\",\"http://dragonmartguide.com/images/products/4_Curtain_String_Lights3.jpg\",\"http://dragonmartguide.com/images/products/5_Curtain_String_Lights4.jpg\",\"http://dragonmartguide.com/images/products/6_Curtain_String_Lights5.jpg\"]', 'Curtain String Lights\r\n\r\nProduct Code : LGTCUR\r\n\r\nLight up any event with our Curtain String Lights. These lights feature a dual color option that can be set on cool white or a warm white glow. The Curtain Lights can be mounted in rows or one above the another for high walls.\r\n\r\nMeasures 5\' wide x 7\' long\r\n\r\n10 hanging strings with 21 lights per string\r\n\r\nAC power cord is included\r\n\r\nConnect up to 2 curtain lights together ', 'Curtain String Lights\r\n\r\nProduct Code : LGTCUR\r\n\r\nLight up any event with our Curtain String Lights. These lights feature a dual color option that can be set on cool white or a warm white glow. The Curtain Lights can be mounted in rows or one above the another for high walls.\r\nMeasures 5\' wide x 7\' long\r\n10 hanging strings with 21 lights per string\r\nAC power cord is included\r\nConnect up to 2 curtain lights together ', '0', '', '', '', '', 'Lights', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1312, 0, 24, 0, 9, '', '2017-09-15 19:24:30', '2017-09-15 19:52:33', 'approval'),
