(8, '{\"134\":{\"cate_parent\":\"Lifestyle \",\"cate_main\":\"Arts and crafts \",\"cate_list\":\"decorative \",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"112\",\"cate_mid\":\"130\"}}', '', 'Black and gold Chinese design lamp base', 'http://dragonmartguide.com/images/products/22_Decorative-items.jpg', '[\"http://dragonmartguide.com/images/products/23_Decorative-items1.jpg\"]', '', '<p>Black and gold tin hand painted lamp base. Has been wired up to UK specifications</p>\r\n<p>&bull;&nbsp;&nbsp;&nbsp; Size: H 40cms D 64 cms<br />&bull;&nbsp;&nbsp;&nbsp; Colour: Black and gold<br />&bull;&nbsp;&nbsp;&nbsp; Material: Tin</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 764, 0, 47, 0, 17, '', '2017-09-24 10:37:14', '0000-00-00 00:00:00', 'on'),
(9, '{\"135\":{\"cate_parent\":\"Lifestyle \",\"cate_main\":\"Arts and crafts \",\"cate_list\":\"handicrafts \",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"112\",\"cate_mid\":\"130\"}}', '', 'Handicrafts', 'http://dragonmartguide.com/images/products/24_handicrafts.jpg', '[\"http://dragonmartguide.com/images/products/25_handicrafts1.jpg\"]', '<p>We are renowned as one of the prominent manufacturers of Brass Handicrafts. These handicrafts are manufactured to enhance the beauty of the interiors. Because of their brilliant design and impeccable quality these are one of the favourites of our customers. To ensure their quality, they are being tested on various parameters ...<br /><br />We offer a wide range of Handicraft items that are alluring in design and durable in feature. Made out of superior quality raw materials that are procured from trusted vendors of the industry, our handicraft items are highly demanded by our customers. Keeping in mind the requirements of our clients, we design and fabricate these items. Quality tested on various parameters, we ensure that are customers are delivered with flawless items. We offer Iron Handicrafts, Marble Handicrafts, Coconut Shell Handicrafts, Brass Handicrafts and Fancy Handicrafts.</p>\r\n<p><br />To retain our goodwill in clients\' consideration, we are manufacturing an excellent range of White Marble Handicraft Items.<br /><br /></p>', '<p>&bull;&nbsp;&nbsp;&nbsp; Color: White<br />&bull;&nbsp;&nbsp;&nbsp; Material: Marble</p>\r\n<p><strong>Features:</strong></p>\r\n<p>&bull;&nbsp;&nbsp;&nbsp; Smooth finish<br />&bull;&nbsp;&nbsp;&nbsp; Elegant look<br />&bull;&nbsp;&nbsp;&nbsp; Aesthetic appeal</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1183, 0, 40, 0, 16, '', '2017-09-24 10:47:09', '0000-00-00 00:00:00', 'on'),
(10, '{\"139\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Home & Garden Furniture\",\"cate_list\":\"Living Room Furniture\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"138\"}}', '', 'Sofa', 'http://dragonmartguide.com/images/products/26_living_room_furniture.jpg', '[\"http://dragonmartguide.com/images/products/27_living_room_furniture1.jpg\"]', '<p><strong>502 Lifes a Beach Mist</strong><br /><strong>(Accent Chairs - Stationary)</strong></p>\r\n<p><br />This Accent Chair in Lifes a Beach Mist fabric by Fusion Furniture will create a warm and inviting living room. With a transitional design, sock arms and tapered feet, it would be a great piece in your home. </p>', '<p><strong>Buoyant Fairfield Hide 3 Seater Sofa</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Dimensions (in cm): H: 98cm x W: 197cm x D: 94cm<br />&bull;&nbsp;&nbsp;&nbsp; Flexitech Seat Cushion uses air2 technology to produce an extremely comfortable high performance seat cushion<br />&bull;&nbsp;&nbsp;&nbsp; Shown: 3 Seater Sofa, Body: Windsor Leather Taupe, Accent: Spring Rose &amp; Trim: Dark Ash<br />&bull;&nbsp;&nbsp;&nbsp; Please use the \"Fabric Notes\" text box if you want to advise on any specifics on the fabrics<br /><br /></p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1091, 0, 112, 0, 50, 'a:2:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-11 10:30:18\";s:6:\"rating\";s:1:\"5\";}i:1;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-11-05 15:39:15\";s:6:\"rating\";s:1:\"4\";}}', '2017-09-24 11:01:21', '0000-00-00 00:00:00', 'on'),
(11, '{\"140\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Home & Garden Furniture\",\"cate_list\":\"Bedroom furniture\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"138\"}}', '', 'Bed', 'http://dragonmartguide.com/images/products/28_bed_room_furniture.JPG', '[\"http://dragonmartguide.com/images/products/29_bed_room_furniture1.jpg\"]', '', '<p>Detailed Dimensions W162.56 cm&nbsp; (64 inches) D223.52 cm&nbsp; (88 inches) H162.56 cm (64 inches)<br /><br />Available in Twin, Full, Queen, King, and Cal King. <br /><br />Vienna is a fully upholstered arched frame that is available as a headboard or a complete bed. Features include a border that can be welted or trimmed with Antique Brass or Nickel nail head. The headboard can also be tufted for an additional charge<br /><br />Detailed Dimensions W162.56 cm&nbsp; (64 inches) D223.52 cm&nbsp; (88 inches) H142.24 cm (56 inches)<br /><br />Bassett\'s Bench*Made Bedroom is American through and through. Each item is crafted from timber harvested in the Appalachian Region and then uniquely bench-made by our own Artisans in Bassett, Virginia. <br /><br />American hardwood lumber is selected for its character so the natural beauty of the wood is captured and highlighted. Distinctive wood grains, hand-planed natural wear and stunning finishes give each piece an heirloom quality. Made entirely of solid wood, you can be sure these styles will stand the test of time.<br /><br /></p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1272, 0, 32, 0, 12, '', '2017-09-24 11:07:27', '0000-00-00 00:00:00', 'on'),
(12, '{\"141\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Home & Garden Furniture\",\"cate_list\":\"Kitchen & Dining room furniture\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"138\"}}', '', 'Dining Room Furniture', 'http://dragonmartguide.com/images/products/31_dining-room-furniture1.jpg', '[\"http://dragonmartguide.com/images/products/205_Dining2.jpg\",\"http://dragonmartguide.com/images/products/30_dining-room-furniture.jpg\"]', '<p>They are a collection of beautiful pictures dining room, done with the perfect, modern and contemporary with a perfect balance between style furniture and fabrics. The dining room can often be more than places to eat and entertain guests. So new life to your dining room with minimalist and simple furnishings complete the change. Add a mirror for the room appear larger or to change the entire room with new furniture and renovation projects. Selection of chair and table for your dining room decor, making the space available and then think about how you want to entertain more and how often you entertain the crowd. And, when combined with the perfect environment, he created all five magic. Enjoy the ultimate in smooth, spoon and fork to eat the food, the environment, obviously, is an important element.</p>\r\n<p>With enriched industrial experience and knowledge, we are providing our clients a wide assortment of Dining Table. Designed with extreme precision, the offered table is designed using quality-tested raw material and highly developed technology by our deft designers. In addition to this, our products undergo different tests under the direction of quality controllers, in order to ensure its faultlessness. Clients can avail the entire assortment from us at market leading rates. <br /><br /><strong>Features:</strong><br />&bull;&nbsp;&nbsp;&nbsp; Designed with perfection<br />&bull;&nbsp;&nbsp;&nbsp; Perfect finish<br />&bull;&nbsp;&nbsp;&nbsp; Easy to maintain</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1092, 0, 97, 0, 69, 'a:1:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-09-27 10:47:32\";s:6:\"rating\";s:1:\"5\";}}', '2017-09-24 11:30:38', '2017-09-26 12:26:06', 'on'),
(13, '{\"142\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Home & Garden Furniture\",\"cate_list\":\"Matress & pillows\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"138\"}}', '', 'Intex Queen 18\" Raised Pillow Rest Airbed Mattress', 'http://dragonmartguide.com/images/products/33_mattress-and-pillows-new.jpg', '[\"http://dragonmartguide.com/images/products/32_mattress_and_pillows1.jpeg\"]', '<p>The Intex Raised Airbed is perfect for the home, dorm room and even camping. Its waterproof, flocked top provides a luxurious sleeping surface, while keeping the sheets in place. The mattress is raised 18 inches from the floor for convenience. <br /><br /><strong>Benefits:</strong><br />&nbsp;<br />&bull;&nbsp;&nbsp;&nbsp; 3 year guarantee<br />&bull;&nbsp;&nbsp;&nbsp; Classic rectangular shaped pillow<br />&bull;&nbsp;&nbsp;&nbsp; Fits a standard pillow case<br />&bull;&nbsp;&nbsp;&nbsp; The soft textured cover is removable for washing at 60&deg;C and is quick drying<br />&bull;&nbsp;&nbsp;&nbsp; Cover meets Oeko-Tex&reg; 100 standard. It has been tested for harmful substances and poses no risks to health<br />&bull;&nbsp;&nbsp;&nbsp; Additional or spare covers may be purchased separately<br />&bull;&nbsp;&nbsp;&nbsp; Luxury 100% cotton TEMPUR-FIT&trade; Pillow Cases also available in 2 colours (optional)<br />&bull;&nbsp;&nbsp;&nbsp; Daily fluffing and puffing will help to maintain this product<br />&bull;&nbsp;&nbsp;&nbsp; Co-ordinates with mattresses from the Original Collection<br />&bull;&nbsp;&nbsp;&nbsp; Smaller items are sent direct to you by courier unless they have been ordered with a mattress or bed</p>', '<p><strong>Intex Queen 18\" Raised Pillow Rest Airbed Mattress:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Perfect for the home, dorm room and even camping<br />&bull;&nbsp;&nbsp;&nbsp; Waterproof, flocked top<br />&bull;&nbsp;&nbsp;&nbsp; Flocked top keeps the sheets in place<br />&bull;&nbsp;&nbsp;&nbsp; Raised 18\" from the floor for convenience<br />&bull;&nbsp;&nbsp;&nbsp; Measures: 64\"L x 82\"W x 18\"H<br />&bull;&nbsp;&nbsp;&nbsp; Model# 67719WL</p>\r\n<p><br />Made from a patented TEMPUR envelope containing thousands of TEMPUR micro-cushions, the Comfort Pillow Original provides plush comfort whilst still maintaining that all so important pressure relief.&nbsp; Just so you can get really comfortable you can fluff and puff the TEMPUR Comfort Pillow Original just the way you want it, and dress it up in your favourite bed linen because it fits easily in to a standard pillow case. The soft fabric cover also meets Oeko-Tex&reg; 100 standard. This means it has been tested for harmful substances and poses no risk to health. </p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1113, 0, 33, 0, 17, '', '2017-09-24 11:49:24', '0000-00-00 00:00:00', 'on'),
(14, '{\"143\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Home & Garden Furniture\",\"cate_list\":\"Cushions & Sofas\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"138\"}}', '', 'Sofas & Cushions', 'http://dragonmartguide.com/images/products/35_sofas_&_cushions1.jpg', '[\"http://dragonmartguide.com/images/products/34_sofas_&_cushions.jpg\"]', '<p>We are one of the leading Exporter, Manufacture and Supply a Sofa Cusions. We provide the best range of sofa cushions such as bench cushions,&nbsp; h cushions and Sofa Cushion with effective &amp; timely delivery. The cushions can be availed in regular or custom sizes. These are available in sober and bright colors with large number of patterns and designs and are woven on traditional handlooms to give them the perfect finish. <br /><br />Backed by rich industry experience and knowledge, we are offering our clients an extensive range of Sofa Cushion. Used widely various homes, hotels, organizations, etc., this cushion is designed and developed by our experts using excellent quality basic materials. Available in various specifications as per the requirements of clients, these Sofa Cushion are highly demanded for their features like fine finish, light weight, attractive patterns, color fastness, dirt &amp; impact resistance and durable finish standards</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1150, 0, 46, 0, 23, '', '2017-09-24 11:58:39', '0000-00-00 00:00:00', 'on'),
