et: No<br />Chair Leg Rubber Feet: Yes<br />Chair Armrest: No</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1121, 0, 39, 0, 19, 'a:1:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-25 17:38:53\";s:6:\"rating\";s:1:\"5\";}}', '2017-09-24 12:22:32', '0000-00-00 00:00:00', 'on'),
(17, '{\"146\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Home & Garden Furniture\",\"cate_list\":\"Decorative Fountains\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"138\"}}', '', 'Medium Granite Three Bowl Fountain Water Feature', 'http://dragonmartguide.com/images/products/41_decorative_fountains1.jpg', '[\"http://dragonmartguide.com/images/products/40_decorative_fountains.jpg\"]', '<p>A self contained granite style fountain with three bowls&hellip;<br />&bull;&nbsp; Old Fashioned Sunnysaze Barrel Solar Water Fountain <br />&bull;&nbsp; Mounting: Free standing <br />&bull;&nbsp; Low voltage water pump with filter recycles the same water <br />&bull;&nbsp; Powered by Solar; Operates in direct sunlight only <br />&bull;&nbsp; Creates the sound of gentle running water</p>', '<p>Product &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Directly Factory bronze large angel water fountain outdoor<br />Product Nomber&nbsp;&nbsp; &nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; JSBF-009<br />Product Size&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; H250cm, other size can be customized<br />Product Material&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Bronze</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1102, 0, 45, 0, 16, '', '2017-09-24 12:36:12', '0000-00-00 00:00:00', 'on');
