(18, '{\"148\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Office furniture\",\"cate_list\":\"Chairs & benches\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"147\"}}', '', 'Chairs', 'http://dragonmartguide.com/images/products/42_chairs_and_benches.jpg', '[\"http://dragonmartguide.com/images/products/43_chairs_and_benches1.jpg\"]', '<p>The Bathroom Safety Shower Chair by Drive Medical is guaranteed to improve your bathing experience. The back, seat and legs snap together making assembly a cinch without tools. Manufactured with a corrosion proof durable aluminum frame which is strong and lightweight, this product provides maximum safety in the bathroom. The seat and back were developed using recycled materials and were ergonomically designed with curves to offer support and add comfort. The seat has holes to allow for drainage and handles in order to reduce the risk of slipping. The shower chair has angled legs with suction style tips providing extra stability. An additional feature of this chair is that the legs are height adjustable in order to meet your specific needs. The product comes with or without a backrest and in four attractive colors: grey, blue, teal and yellow but no matter the color, this Bathroom Safety Shower Tub Chair will make a great addition to your home.</p>\r\n<p><strong>Features</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Aluminum frame is lightweight, durable and corrosion proof <br />&bull;&nbsp;&nbsp;&nbsp; Angled legs with suction style tips provide additional stability <br />&bull;&nbsp;&nbsp;&nbsp; Drainage holes in seat reduce slipping <br />&bull;&nbsp;&nbsp;&nbsp; Easy to clean <br />&bull;&nbsp;&nbsp;&nbsp; Easy, tool free assembly of seat and legs <br />&bull;&nbsp;&nbsp;&nbsp; Environment friendly product <br />&bull;&nbsp;&nbsp;&nbsp; Pinch free cover allows for push pins to be depressed without pinching fingers; the audible \"click\" will be heard when secure <br />&bull;&nbsp;&nbsp;&nbsp; Support collar prevents leg movement<br />&bull;&nbsp;&nbsp;&nbsp; Wrought iron furniture, that are usually used for patio and garden decorating, come into modern homes, creating a new trend in interior decorating with metal chairs and benche<br /><br /></p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1124, 0, 33, 0, 10, '', '2017-09-24 12:58:19', '0000-00-00 00:00:00', 'on'),
(19, '{\"149\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Office furniture\",\"cate_list\":\"Tables & Workstations\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"147\"}}', '', 'Computer Table', 'http://dragonmartguide.com/images/products/44_tables_and_workstaitons.jpg', '[\"http://dragonmartguide.com/images/products/45_tables_and_workstaitons1.jpg\"]', '<p>Backed by rich industry experiences; we are highly engaged in manufacturing a premium quality range of Office Employee Workstation.<br /><br />Features:</p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Impeccable finish<br />&bull;&nbsp;&nbsp;&nbsp; High strength<br />&bull;&nbsp;&nbsp;&nbsp; Durabilit<br /><br /></p>', '<p>Item No.&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; :&nbsp; &nbsp; &nbsp;&nbsp; HL-Y-70-5<br />Material&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; : &nbsp; &nbsp;&nbsp; MDF Sheet and steel structure<br />Size&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; : &nbsp; &nbsp;&nbsp; W2700/3100*D2800/2800*H1100<br />Thickness &nbsp; &nbsp; &nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Steel:0.7-1.5mm, wood top:25mm<br />Structure&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp; &nbsp; &nbsp; knocked down structure, could be assembled within 6-10minutes<br />Surface&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; : &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; adopts electrostatic powder coating, it&rsquo;s anti-rust and anti-corrosion, harmless to&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; environment and human<br />Feature&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; skillful workmanship, professional design,simple concise, green product <br />Application &nbsp;&nbsp;&nbsp; : &nbsp; &nbsp; &nbsp; popular used in office workplace<br />Package&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; : &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; With poly-foam inner lining and multi-layer carton box<br />Available&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 