(21, '{\"151\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Office furniture\",\"cate_list\":\"reception furniture\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"147\"}}', '', 'Reception Table', 'http://dragonmartguide.com/images/products/49_reception-table1.png', '[\"http://dragonmartguide.com/images/products/48_reception-table.png\"]', '<p>In a zest to accomplish utmost approval and consent of the patrons, we provide the handpicked quality of Wooden Reception Table. Appreciated for its regal look, alluring design and smooth finishing, the reception table is designed in accordance to the latest market trends. In order to meet and manage the diverse needs of the patrons, the reception table is available with us in various designs and sizes. <br /><br /><strong>Features:</strong><br />&bull;&nbsp;&nbsp;&nbsp; Contemporary design<br />&bull;&nbsp;&nbsp;&nbsp; Perfect finishing and smooth texture<br />&bull;&nbsp;&nbsp;&nbsp; Portable and lightweight<br />&bull;&nbsp;&nbsp;&nbsp; Eye-catching appearance<br /><br />&bull;&nbsp;&nbsp;&nbsp; Counterwise Reception Unit<br />&bull;&nbsp;&nbsp;&nbsp; The Counterwise reception unit makes a dramatic first impression.&nbsp; Modular desk top perforated panels designed to fit standard desk tops.&nbsp; These units can be in black or silver perforated panels with any colour melamine top.<br />&bull;&nbsp;&nbsp;&nbsp; The counterwise unit consists of 2 x 1500mm desk with full modesty, 800x800mm corner link,&nbsp; 4 x link plates, 2 x 1500 counter tops, and 1 x 800 curved counter top.&nbsp; Drawers are excluded</p>\r\n<p>The reception table a well designed furniture enhance the looks of your reception area and also designed aptly to look in to the various needs of your reception personell as well as the clients they receive. The reception table will be able to handle various operations like communications, and customer handling. The counter raiser with contrast color adds to the beauty of this reception table. The counter raiser also helps give good writing platform to the custormer and sufficient privacy of work to the personnel.</p>\r\n<p>&nbsp;</p>', '<p>Minimum Order Quantity&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1 Piece<br />Size&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :&nbsp; &nbsp;&nbsp; 1800X600X1200<br />Color&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Highlandpine,dark akasia,light akasia,wenge,beech,dark grey,light gray,off white.<br />Design Type&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; &nbsp;&nbsp; Standard<br />Brand&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp; &nbsp;&nbsp; Nicewood</p>\r\n<p><strong>Additional Information:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Item Code&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : &nbsp; &nbsp;&nbsp;&nbsp; NR-04<br />&bull;&nbsp;&nbsp;&nbsp; Port of Dispatch&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp; &nbsp;&nbsp;&nbsp; Standard<br />&bull;&nbsp;&nbsp;&nbsp; Production Capacity&nbsp; : &nbsp; &nbsp;&nbsp;&nbsp; 20PC/Day<br />&bull;&nbsp;&nbsp;&nbsp; Delivery Time&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3-4 Week<br />&bull;&nbsp;&nbsp;&nbsp; Packaging Details&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp; &nbsp; &nbsp; Standard</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1063, 0, 38, 0, 17, '', '2017-09-24 14:04:04', '0000-00-00 00:00:00', 'on'),
(22, '{\"152\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Office furniture\",\"cate_list\":\"curtains & blinds\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"147\"}}', '', 'Curtains', 'http://dragonmartguide.com/images/products/50_curtains_&_blinds.jpg', '[\"http://dragonmartguide.com/images/products/51_curtains_&_blinds1.jpeg\"]', '<p><strong>Vertical blinds\' introduction</strong><br />&nbsp;<br />1.&nbsp; Vertical blinds adopts plummet leaf type structure,the leafs can rotate 180 degrees, not only can adjust indoor light freely but also ventilate the room and shading.<br />&nbsp;<br />2.&nbsp; Rail made of high quality aluminum alloy section bar, smooth opening and closing, surface oxidation and dull polish processing, fine and smooth, durable and durable;<br />&nbsp;<br />3. Lead rail 4 level gears regulating stem made of 5mm aluminum core, fixed by pure copper blind nuts and engineering plastic. <br /><br /><strong>Features:</strong><br /><br />1. The Ceiling Mounted Hospital Curtains Systems are widely used in the hospitals.<br />2. Being Ventilated: On the top of the Ward Curtains, there are reticular and oval holes for ventilation. Air or winds can go through this part to keep a good ventilation environment.<br />3. Being Neat: Ward Curtains used in Normal Wards, Intensive Care Units, Injection Rooms, Body Examine Room, etc. to make the palce orderly and neat.<br />4. Keep Privacy: The patients, the visitors in the same wards or rooms to keep their privacy by the Ward Curtains<br />5. Saving Space: Ward Curtains system is ceiling mounted, Can be fold-able. Needn&rsquo;t any additional space.<br />6. Being Convenient to install: the Wards Curtains System tracks can be installed easily, and the curtains can be offload; easy to clean.<br />7.Fireproofness: Compliant with GB17591-1998 standard Both fireproofing and non-fireproofing medical separating curtain cloth is available.<br />With the help of rich industry experience and skilled team of professionals, we are offering Vertical Blinds. </p>\r\n<p><strong>Uses:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Used as curtains<br /><br /><br /></p>', '<p>Type: vertical</p>\r\n<p><strong>Applications:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Both residential and commercial areas</p>\r\n<p><strong>Features:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Simple installation <br />&bull;&nbsp;&nbsp;&nbsp; Less maintenance required <br />&bull;&nbsp;&nbsp;&nbsp; Light weight</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1056, 0, 43, 0, 14, '', '2017-09-24 14:11:10', '0000-00-00 00:00:00', 'on'),
