(32, '{\"168\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Interior & Decorative Furniture\",\"cate_list\":\"Doors & Windows\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"165\"}}', '', 'Doors and Windows', 'http://dragonmartguide.com/images/products/70_Door_and_windows.jpg', '[\"http://dragonmartguide.com/images/products/71_Door_and_windows1.jpg\"]', '<p><strong>Product Details:</strong><br />Open Style <br />Hinged</p>\r\n<p><br /><strong>Product Description:</strong>We are a dynamic, quality-oriented company, ranking amid the chief entities in making available best-in-class AluminiumModular Door to the clients</p>\r\n<p><br /><strong>Aluminium Modern Sliding Window</strong><br /><strong>Product Description:</strong><br />With enriched industrial acquaintance, we are providing a varied series ofAluminium Modern Sliding Window.</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 637, 0, 43, 0, 18, '', '2017-09-24 17:26:41', '0000-00-00 00:00:00', 'on'),
(33, '{\"170\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Sports & Leisure\",\"cate_list\":\"Sports Furniture\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"169\"}}', '', 'Sports furniture', 'http://dragonmartguide.com/images/products/73_sports_furniture1.jpeg', '[\"http://dragonmartguide.com/images/products/72_sports_furniture.jpeg\"]', '<p><strong>Highlights:</strong></p>\r\n<p><br />&bull;&nbsp; Official 9\' x 5\' tournament sized table<br />&bull;&nbsp; 3/4\" playfield<br />&bull;&nbsp; Fold-up design for easy storage<br />&bull;&nbsp; Includes premium table cover, net and 2 clip posts<br /><br /><strong>Product Description:</strong></p>\r\n<p><br />Our company has set benchmark in offering Fancy Massage Chair to the clients. Fancy Massage Chair is made from high quality of raw material which ensures stability at user end. This product helps to control the blood pressure and oxygen as well as other body functions becomes normal. Offered range is tested by the quality controllers on various parameters.<br />This is a low budget shampoo stand with water reservoir for those who has space constraints. Customer feedback is very satisfactory so far.<br /><br />Price mentioned here is tentative and before discount, exclusive of TAX and delivery charges.<br /><br />(We can deliver furniture and equipment as per your plan (design/style, color and budget), if we get your advance order with min 2-3 months delivery time)</p>\r\n<p><br /><strong>Features:</strong><br /><br />&bull;&nbsp;&nbsp;&nbsp; Body massage<br />&bull;&nbsp;&nbsp;&nbsp; Pedicure<br />&bull;&nbsp;&nbsp;&nbsp; Adjustable chair<br />&bull;&nbsp;&nbsp;&nbsp; Excellent finish<br />&bull;&nbsp;&nbsp;&nbsp; Attractive look<br />&bull;&nbsp;&nbsp;&nbsp; Elegant design</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1237, 0, 53, 0, 21, '', '2017-09-24 17:34:24', '0000-00-00 00:00:00', 'on'),
(34, '{\"179\":{\"cate_parent\":\"Food\",\"cate_main\":\"Equipments\",\"cate_list\":\"Kitchen Equipments\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"173\",\"cate_mid\":\"178\"}}', '', 'Kitchen equipments', 'http://dragonmartguide.com/images/products/74_kitchen_equipments.jpg', '[\"http://dragonmartguide.com/images/products/75_kitchen_equipments1.jpg\"]', '<p><strong>Product Description:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Commercial Kitchen Equipment Manufacturers in Hyderabad <br />&bull;&nbsp;&nbsp;&nbsp; Kitchen Equipments <br />&bull;&nbsp;&nbsp;&nbsp; Canteen Equipments <br />&bull;&nbsp;&nbsp;&nbsp; Commercial Cooking Equipment <br />&bull;&nbsp;&nbsp;&nbsp; Deep Fat Fryers <br />&bull;&nbsp;&nbsp;&nbsp; Kitchen Work Tables <br />&bull;&nbsp;&nbsp;&nbsp; Food Mixers <br />&bull;&nbsp;&nbsp;&nbsp; Commercial Sinks <br />&bull;&nbsp;&nbsp;&nbsp; Garbage Trolley <br />&bull;&nbsp;&nbsp;&nbsp; Commercial Kitchen Trolleys</p>\r\n<p><br />Our client can avail from us with wide range of Hotel Equipments. This product is fabricated using high quality raw material in complying with the set industry standards and norms, which ensures its durability, efficiency and longer service life. The offered product range is available in various specifications to meet the variegated requirements of our clients. Further, these products are available at the most economical prices.</p>\r\n<p><br /><strong>Product Description:</strong></p>\r\n<p><br />We are a trusted name that is involved in the supplying and trading of best quality Crathco Beverage Dispenser. The offered product is highly renowned for its stability and longer functional life. The range of crathco beverage dispensers offered by us has heaped words of intense praise for its perfect finish, low power consumption and compact design.<br /><br /><strong>Features:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Low power consumption<br />&bull;&nbsp;&nbsp;&nbsp; Compact design<br />&bull;&nbsp;&nbsp;&nbsp; Perfect finish</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 494, 0, 58, 0, 21, 'a:1:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-29 00:00:44\";s:6:\"rating\";s:1:\"4\";}}', '2017-09-24 17:45:44', '0000-00-00 00:00:00', 'on'),
(35, '{\"180\":{\"cate_parent\":\"Food\",\"cate_main\":\"Equipments\",\"cate_list\":\"Food Processors\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"173\",\"cate_mid\":\"178\"}}', '', 'Food Processors', 'http://dragonmartguide.com/images/products/77_Food_processor1.jpg', '[\"http://dragonmartguide.com/images/products/76_Food_processor.jpg\"]', '<p>Toasts, seals and slices two sandwiches at a time with easy to clean, non-stick plates.<br />Stands upright with cord wrap storage for ultimate space saving.<br /><br /><strong>Features include:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Classic polished stainless steel and black styling<br />&bull;&nbsp;&nbsp;&nbsp; Cuts and seals two rounds of sandwiches<br />&bull;&nbsp;&nbsp;&nbsp; Non-stick plates<br />&bull;&nbsp;&nbsp;&nbsp; Easy to clean<br /><br /></p>', '<p>The Multipro Excel is designed to set Kenwood at the pinnacle of high quality food processing and introduces the concept of genuine total system to the consumer. It has 2 Tritan bowls and and array of attachments. All powered by a powerful 1300W motor with variable speed and pulse function. There is also an illuminated auto function.<br /><br /><strong>Key Specification:</strong><br /><br /><br />&bull;&nbsp;&nbsp;&nbsp; 1300W motor<br />&bull;&nbsp;&nbsp;&nbsp; Variable speed plus pulse<br />&bull;&nbsp;&nbsp;&nbsp; 4 Litre and 1.6Litre Tritan bowls<br />&bull;&nbsp;&nbsp;&nbsp; 1.6L Thermo Resist glass blender<br />&bull;&nbsp;&nbsp;&nbsp; Integral weighing function</p>\r\n<p>&nbsp;</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 825, 0, 33, 0, 12, '', '2017-09-24 18:14:21', '2017-09-25 08:44:09', 'on'),
(36, '{\"181\":{\"cate_parent\":\"Food\",\"cate_main\":\"Equipments\",\"cate_list\":\"Hot & Cold Storages\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"173\",\"cate_mid\":\"178\"}}', '', 'Cold Storage', 'http://dragonmartguide.com/images/products/78_Hot&Cold_storages.jpg', '[\"http://dragonmartguide.com/images/products/79_Hot&Cold_storages1.jpg\"]', '<p>Hot Food Storage Units is a part of Hot Food Storage Units pictures gallery. To see this Hot Food Storage Units in High Resolutions.This digital photography of Hot Food Storage Units has dimension 480 &times; 480 pixels. </p>', '<p>The Whirlpool WTE2210 is a convenient fridge freezer unit, perfectly sized for the small household.<br /><br />There is a total of 218 litres of capacity, spaced over 4 safety glass shelves offer plenty of space for a weekly shop while the A+ energy rating helps you to save not only energy but money too.<br /><br /><strong>Key Specifications:</strong> <br /><br /><br />&bull;&nbsp;&nbsp;&nbsp; Freestanding Design<br />&bull;&nbsp;&nbsp;&nbsp; Total Capacity: 218 Litres<br />&bull;&nbsp;&nbsp;&nbsp; 4 Shelves<br />&bull;&nbsp;&nbsp;&nbsp; Noise Level: 40dB<br />&bull;&nbsp;&nbsp;&nbsp; Energy Rating: A+</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1116, 0, 35, 0, 14, '', '2017-09-25 08:49:32', '0000-00-00 00:00:00', 'on');
