(37, '{\"123\":{\"cate_parent\":\"Lifestyle \",\"cate_main\":\"leisure and entertainment \",\"cate_list\":\"travel accessories \",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"112\",\"cate_mid\":\"118\"}}', '', 'Travel Accessories', 'http://dragonmartguide.com/images/products/81_travel_accessories1.jpg', '[\"http://dragonmartguide.com/images/products/80_travel_accessories.jpg\"]', '<p><strong>Details &amp; Features:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Expansion zipper for more carrying capacity<br />&bull;&nbsp;&nbsp;&nbsp; Ultra-durable multi-directional AWD spinner wheels<br />&bull;&nbsp;&nbsp;&nbsp; Innovative Coat Keeper&trade; holds jacket to the top of the bag<br />&bull;&nbsp;&nbsp;&nbsp; Puncture-resistant lockable zippers with one convenient central lock<br />&bull;&nbsp;&nbsp;&nbsp; Built to withstand friction and harsh weather<br />&bull;&nbsp;&nbsp;&nbsp; Oversized treaded wheels built with heavy-duty wheel housing, skid plate and bumper protection<br />&bull;&nbsp;&nbsp;&nbsp; Reflective finger loop zipper pulls for easy access while wearing gloves<br />&bull;&nbsp;&nbsp;&nbsp; Padded sleeves for carrying and protecting your laptop or tablet<br />&bull;&nbsp;&nbsp;&nbsp; Secure gear with compression straps and external lash points</p>', '<p>Capacity: 7325 cu in | 120 L Expanded Capacity: 7995 cu in | 131 L Dimensions: 20 x 30.5 x 14.5 in | 51 x 77.5 x 37 cm Expanded Dimensions: 20 x 30.5 x 16.5 in | 51 x 77.5 x 42 cm Weight: 11 lbs 4 oz | 5.13 kg Material: Bi-Tech Heather | 1000D Helix Poly Twill | Bayer Polycarbonate</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1216, 0, 28, 0, 10, '', '2017-09-25 09:03:37', '0000-00-00 00:00:00', 'on'),
(38, '{\"185\":{\"cate_parent\":\"Industrial\",\"cate_main\":\"Tools & Equipments\",\"cate_list\":\"hardwares\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"183\",\"cate_mid\":\"184\"}}', '', 'Hardware', 'http://dragonmartguide.com/images/products/82_hardwares.jpg', '[\"http://dragonmartguide.com/images/products/83_Hardwares1.jpg\"]', '<p><strong>Nylon M3x6mm Threaded Male-Female Standoff Screws Assortment Kit.</strong><br />There are 25pcs M3x6mm Threaded Male-Female Standoff Screws.<br /><br />Material: Nylon<br />Color: Black<br />Quantity: 25pcs<br />Standoff Length 6mm (not include male end thread length), Male end thread length: 6mm<br />Thread: M3 (3mm), thread pitch: 0.5m<br /><br /><strong>Package included:</strong><br />25 x M3x6mm Threaded Male-Female Standoff Screws</p>\r\n<p><strong>Features:</strong><br /><br />You can install both two side of Isolation column, very convenient to use<br />You can use it in repairing car, bicycle,circuit board, etc.<br /><br /><strong>Description:</strong><br /><br />Material: Copper Alloy<br />Color: Copper<br />Size: M3*4/6/8/10/12/15/20+6mm <br /><br /><strong>Package included:</strong><br /><br />100pcs M3*4/6/8/10/12/15/20+6mm&nbsp; Brass Isolation Column</p>\r\n<p><strong>Product Description:</strong><br />CSS M3 Male x M3 Female Hexagonal Brass PCB Standoffs Spacers M3*4/6/8/10/12/15/20+6mm 100pcs</p>', '<p><strong>Item specification:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Screw Type: Set Screws <br />&bull;&nbsp;&nbsp;&nbsp; Drive Style: External Hex <br />&bull;&nbsp;&nbsp;&nbsp; Material: Brass <br />&bull;&nbsp;&nbsp;&nbsp; Head Style: Hex <br />&bull;&nbsp;&nbsp;&nbsp; Package: 100-199Pcs <br />&bull;&nbsp;&nbsp;&nbsp; DIY Supplies: Electrical <br />&bull;&nbsp;&nbsp;&nbsp; is_customized: Yes</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 889, 0, 33, 0, 13, '', '2017-09-25 09:20:08', '0000-00-00 00:00:00', 'on'),
