\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Brand Name: DEKO <br />&bull;&nbsp;&nbsp;&nbsp; Max. Drilling Diameter: Max. 35mm in Wood <br />&bull;&nbsp;&nbsp;&nbsp; Weight: 3.42lbs (1.55kg) <br />&bull;&nbsp;&nbsp;&nbsp; No-Load Speed: 1600rpm <br />&bull;&nbsp;&nbsp;&nbsp; Rated Input Power: 350W <br />&bull;&nbsp;&nbsp;&nbsp; Application: Drilling in Steel/ in Wood/ in Ceramic <br />&bull;&nbsp;&nbsp;&nbsp; DIY Supplies: Woodworking <br />&bull;&nbsp;&nbsp;&nbsp; Frequency: 50-60Hz <br />&bull;&nbsp;&nbsp;&nbsp; Rated Torque: 38N.m <br />&bull;&nbsp;&nbsp;&nbsp; is_customized: Yes <br />&bull;&nbsp;&nbsp;&nbsp; Power Source: DC <br />&bull;&nbsp;&nbsp;&nbsp; Drill Type: Cordless Drill <br />&bull;&nbsp;&nbsp;&nbsp; Model Number: GCD18DU2 <br />&bull;&nbsp;&nbsp;&nbsp; Rated Voltage: 18V <br />&bull;&nbsp;&nbsp;&nbsp; Special Features: Light Weight, LED Worklight, Always Ready <br />&bull;&nbsp;&nbsp;&nbsp; Torque Settings: 15+1 Settings <br />&bull;&nbsp;&nbsp;&nbsp; Chuck Type: Keyless <br />&bull;&nbsp;&nbsp;&nbsp; Chuck Size: 1/2\" (2-13cm) <br />&bull;&nbsp;&nbsp;&nbsp; Battery Pack: 1 Lithium Ion Battery Pack required (included) <br />&bull;&nbsp;&nbsp;&nbsp; Battery Cell Type: 3.6V Lithium Ion Battery x 5 <br />&bull;&nbsp;&nbsp;&nbsp; Charger Adapter Input: 100-240V AC 50-60Hz <br />&bull;&nbsp;&nbsp;&nbsp; Charger Adapter Output: 21.5V DC 1500mAh <br />&bull;&nbsp;&nbsp;&nbsp; Charging Time: 1 Hour </p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 893, 0, 50, 0, 18, 'a:1:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-28 15:16:25\";s:6:\"rating\";s:1:\"4\";}}', '2017-09-25 09:46:39', '0000-00-00 00:00:00', 'on'),
(40, '{\"187\":{\"cate_parent\":\"Industrial\",\"cate_main\":\"Tools & Equipments\",\"cate_list\":\"Industrial Equipments\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"183\",\"cate_mid\":\"184\"}}', '', 'VSR hammer drill, Crown Stop Kit for Miter Saws', 'http://dragonmartguide.com/images/products/87_industrial_equipments1.png', '[\"http://dragonmartguide.com/images/products/86_industrial_equipments.png\"]', '<p><strong>Description:</strong></p>\r\n<p><br />The new Bosch 1191VSRK 1/2 In. VSR hammer drill has a powerful 7 A reversing motor. It also has an ergonomic design. All this means the 119VSRK is engineered to provide the highest performance to weight ratio in its class. Use the selector lever to choose the hammer drill for concrete. Select drill only for steel, wood, or aluminum. Kit includes 360-degree handle, depth gauge, and carrying case.</p>\r\n<p><br /><strong>Includes:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Auxiliary Handle -- 1 612 025 024<br />&bull;&nbsp;&nbsp;&nbsp; Depth Gauge -- 1 613 001 010<br />&bull;&nbsp;&nbsp;&nbsp; Chuck Key -- 3 608 571 069</p>\r\n<p><strong>Crown Stop Kit for Miter Saws</strong></p>\r\n<p><strong>Description:</strong></p>\r\n<p><br />The Bosch MS1233 crown stop kit for miter saws allows crown molding to be nested against fence for simple miter cuts with no beveling required. When not in use, the stops can be easily flipped back over the fence and stored on the tool out of the way of other cutting applications. Works will models: GCM12SD, CM10GD, CM12, CM8S, CM12SD, 5412, 4410, 4405, 4310 and 4212. Does NOT work with models 5312, 4412, 3912, or 3915.</p>\r\n<p><br /><strong>Includes:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp; &nbsp;Left and right crown stops<br />&bull;&nbsp;&nbsp; &nbsp;Mounting knobs and hardware<br /><br /></p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1241, 0, 27, 0, 12, '', '2017-09-25 10:30:38', '2017-09-25 10:59:08', 'on'),
(41, '{\"190\":{\"cate_parent\":\"Industrial\",\"cate_main\":\"Machinaries\",\"cate_list\":\"General Machinaries\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"183\",\"cate_mid\":\"189\"}}', '', 'Heat Gun with High C.F.M', 'http://dragonmartguide.com/images/products/91_General_machinaries1.png', '[\"http://dragonmartguide.com/images/products/90_General_machinaries.png\"]', '', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1221, 0, 29, 0, 10, '', '2017-09-25 11:20:39', '0000-00-00 00:00:00', 'on'),
(42, '{\"188\":{\"cate_parent\":\"Industrial\",\"cate_main\":\"Tools & Equipments\",\"cate_list\":\"Industrial Accessories\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"183\",\"cate_mid\":\"184\"}}', '', 'Aluminum Contractors Tripod', 'http://dragonmartguide.com/images/products/88_industrial_accessories.png', '[\"http://dragonmartguide.com/images/products/89_industrial_accessories1.png\"]', '<p><strong>&nbsp;In. Aluminum Contractors\' Tripod</strong></p>\r\n<p><br /><strong>Description:</strong></p>\r\n<p><br />The Bosch BT160 contractors\' tripod is designed for exterior use with A rotary laser on the job site. It features A universal flat head, string hook for a plumb bob and is lightweight for easy transportation on the job site.</p>\r\n<p><br /><strong>Benefits:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Lightweight and durable aluminum design - hinges, clamps, and shoe casting<br />&bull;&nbsp;&nbsp;&nbsp; Painted casting for a durable and long lasting finish<br />&bull;&nbsp;&nbsp;&nbsp; Flat, elevator head type with 5/8-11 thread<br />&bull;&nbsp;&nbsp;&nbsp; Extended height of 63-in</p>\r\n<p>&nbsp;</p>', '<p><strong>Attributes</strong>&nbsp;&nbsp;&nbsp;</p>\r\n<p>Closed Height : 38-in. (97 cm)<br />Extended Height : 63-in. (160 cm)<br />Material : Aluminum<br />Tripod Thread : 5/8 - 11<br />Weight :&nbsp; 9.0kg</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 892, 0, 36, 0, 13, '', '2017-09-25 11:49:18', '0000-00-00 00:00:00', 'on'),
