; &nbsp; &nbsp;&nbsp; :&nbsp; 0.15mm<br />&nbsp;Repeatable accuracy &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; : &nbsp; &plusmn;0.002mm</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 836, 0, 48, 0, 22, '', '2017-09-25 12:11:30', '0000-00-00 00:00:00', 'on'),
(46, '{\"194\":{\"cate_parent\":\"Industrial\",\"cate_main\":\"Machinaries\",\"cate_list\":\"Hydraulic & Pnematics\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"183\",\"cate_mid\":\"189\"}}', '', 'Air cylinders ', 'http://dragonmartguide.com/images/products/98_Hydraulic_&_pneumatics.jpg', '[\"http://dragonmartguide.com/images/products/99_Hydraulic--&-pneumatics1-new.jpg\"]', '<p>The new generation Stanley GT18 Power Unit is the latest in construction site hydraulic power for tools. The GT1 8 conforms to the Hydraulic Tools Manufacturers Association (HTMA) Type 1 and Type 2 tool circuit recommended performance. It will deliver 5 gpm or 8 gpm at pressures up to 2000 psi with heat rejection capacity exceeding the HTMA recommendation of 5 hp. <br /><br />Computerized, electronic throttle control is standard on all models. The control allows for selection of constant engine speed or automatic speed. Automatic speed increases engine speed from idle when it senses tool working demand. When there is no tool working demand, engine speed is returned to idle. The automatic speed mode provides lower fuel use and less noise. <br /><br />All electric control system with rotary switches. All components in the GT18 are assembled for easy routine servicing. The upper frame can be removed for more serious servicing. A quartz hour meter in the control panel records engine run time. <br />The hydraulic pump is mounted directly to the engine eliminating any misalignment and ensuring long life of the drive coupling. An in-tank hydraulic filter continuously cleans the hydraulic fluid and assures that refill fluid passes through the filter for a clean refill. A 35-Ah sealed, non-spillable, no-maintenance battery is located inside a covered compartment. <br /><br />Moving the GT18 around is made easy with a lift-and-latch handle. <br />Both engine models (Briggs or Honda) have pressure lubrication systems with a pressure sensing switch that will shut down the engine if the engine oil level is too low. <br />Some GT18 models are available with 110 vac, 60 Hz electric power provided by a Briggs &amp; Stratton PowerLink inverter system. This system will deliver 1000 watts, continuous and 1500 watts in termittent power through GFCI receptacles.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><br />&bull; Application of new seal material and buffer structure <br />&bull; Low start pressure <br />&bull; Stable operation <br />&bull; Fine tightness <br />&bull; Long service life <br />&bull; Head and rear cover are specially electrophoresis-coated <br />&bull; Beautiful appearance <br />&bull; Widely used in automatic devices, e.g. light industry, chemical industry, textile, electron, machinery, etc<br />&nbsp;</p>', '<p>Standard or Nonstandard: Standard<br />Structure: Piston Cylinder<br />Power: Pneumatic<br />Body Material: Aluminum<br />Maximum Stroke: 50mm<br />Shaft Diameter: 50mm<br />Place of Origin: Zhejiang, China (Mainland)<br />Model Number: SCF50X50<br />Brand Name: YONGYI<br />Quality System Certification: ISO9001:2008 and CE Certification<br />Quality control: 7 technicials of QA,QC,QE.<br />Sample: Free of charge<br />Working Pressure: 0.15~1.0Mpa<br />Fluid: 40 micron filtered air<br />Medium and Ambinent Temperature: 5~60Ã¢â€žÆ’<br />Compression Pressure: 1.5Mpa<br />Operating Piston Speed Range: 100~500mm/s<br />Durability: &le;300</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 830, 0, 40, 0, 11, '', '2017-09-25 12:23:39', '0000-00-00 00:00:00', 'on'),
(47, '{\"196\":{\"cate_parent\":\"Industrial\",\"cate_main\":\"Warehousing & Handling\",\"cate_list\":\"Storage\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"183\",\"cate_mid\":\"195\"}}', '', 'storage', 'http://dragonmartguide.com/images/products/100_storage.jpg', '', '<p>Housing single/dual expander (field upgradable) modules, dual fans and redundant power supply in short-depth design provides full redundancy and high availability for critical, performance driven storage demand. The combination of LSI expander chip and AIC\'s own firmware is a guarantee of compatibility with most mainstream hard drives, HBAs and RAID controllers (SAS2/SAS3).</p>\r\n<p><br /><strong>Key Features:</strong></p>\r\n<p><br />&bull; Intelligent Enclosure Management<br />&bull; Individual drive power management<br />&bull; Cutting edge performance and scalability<br />&bull; External port self-configuration to host or expansion<br />&bull; Supports SES-2 (SCSI Enclosure Service)<br />&bull; Hot swap design for easy maintenance and management<br />&bull; Adjustable Thermal Profile<br />&bull; Easy deployment</p>', '<p><strong>General</strong><br />Number of Expander: Single/Dual<br />Expander Chip: LSI SAS3x28R<br />Host/Expansion Interface : 3 x Mini SAS HD (SFF-8644) per expander tray<br /><br /><strong>Drives Supported</strong><br /><br />Drive Interface:<br />&bull; 12Gb &amp; 6Gb SAS if using dual expanders<br />&bull; 12Gb &amp; 6Gb SAS/SATA if using single expander<br />Form Factor: 3.5&rdquo;<br /><br />Administration / Management<br /><br />Admin/Firmware Upgrade:<br />&bull; In-band &amp; Serial port interface<br />&bull; Intelligent Enclosure Management port (optional)<br />LED Indicators, Audible Alarm: Yes<br /><br /><strong>Hot swap &amp; Redundancy</strong><br /><br />Disk Drive: Hot swap 16-bay<br />Cooling: 2 x 8038 hot swap fans<br />Power Supply: 549W 1+1 hot-swap redundant 80+ Platinum<br />Power Entry: Dual AC Inlet<br />Expander: Dual expanders<br /><br /><strong>Electrical &amp; Environment</strong><br /><br />Universal A/C Input: 100~240V AC full range<br />Operating Environment:<br />&bull; Temperature 0&ordm;C to 35&ordm;C<br />&bull; Relative humidity 20% to 80%<br />Non-operating Environment:<br />&bull; Temperature -20&ordm;C to 60&ordm;C<br />&bull; Relative humidity 10% to 90%<br /><br /><strong>Physical Specification</strong><br /><br />Dimensions (W x D x H) (with chassis ears):<br />&bull; mm: 483 x 534 x 131<br />&bull; inches: 19 x 21 x 5.2<br />Gross Weight (w/ PSU; w/o Rail &amp; Disks):<br />&bull; kgs: 24.8<br />&bull; lbs: 54.6<br />Packaging Dimension (W x D x H):<br />&bull; mm: 595 x 785 x 338<br />&bull; inches: 23.4 x 31 x 13.3<br />Mounting:<br />&bull; Standard: Adjustable plate<br />&bull; Option: 20&rdquo; tool-less rail</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 706, 0, 38, 0, 12, '', '2017-09-25 12:34:33', '0000-00-00 00:00:00', 'on'),
