]: Based on 2.4 GHz remote control technology, so the mini quadcopter can be controlled more precisely, its remote control system is simple to set up and fly, making it ideal for beginners. <br />&bull;&nbsp;&nbsp;&nbsp; [360 DEGREE ROLLING]: The simple flying of WSAD is to boring, and the new 3D rolling special effects surprise all the people, making the rc helicopter possible for excellent performance of flips and rolls. <br />&bull;&nbsp;&nbsp;&nbsp; [ONE-KEY RETURN]: With built-in positioning system, the drone quadcopter can auto locate the remote control, just press the one key return button, rc drone will automatically come back to you. <br />&bull;&nbsp;&nbsp;&nbsp; [SERVICE GUARANTEE]: Please note EACHINE only sells BRAND NEW products. If you found that the box tape was teared down or some accessories was missing in package when you received the item, please don\'t worry, we have tested our product before shipment in order to ensure the products are in good condition. If you have any problem about product, please do not hesitate to contact us, we will try our best to help<br /></span></p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 593, 0, 29, 0, 12, '', '2017-09-25 15:38:54', '0000-00-00 00:00:00', 'on'),
