(57, '{\"215\":{\"cate_parent\":\"Building Matrials\",\"cate_main\":\"Construction materials\",\"cate_list\":\"Plumbing fittings\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"211\",\"cate_mid\":\"212\"}}', '', 'Furniture Grade PVC', 'http://dragonmartguide.com/images/products/118_plumbing_fittings.jpg', '[\"\"]', '<p>Build center supports of structural PVC applications with the Formufit 1/2 in. Furniture Grade PVC 5-Way Cross. This specialty PVC cross connector joins 5 lengths of 1/2 in. Sch. 40 PVC pipe at 5 points, 4 horizontal and 1 vertical. PVC construction.</p>\r\n<p>&bull;&nbsp;&nbsp;&nbsp; Made from ultra-strong, UV-resistant furniture grade PVC material<br />&bull;&nbsp;&nbsp;&nbsp; Unmarked, glossy surface finish and tapered fitting ends provide for clean, professional appearance<br />&bull;&nbsp;&nbsp;&nbsp; Slip-style pipe insertion for easy connections<br />&bull;&nbsp;&nbsp;&nbsp; Works with 1/2 in. Sch. 40 plumbing grade or furniture grade PVC pipe<br />&bull;&nbsp;&nbsp;&nbsp; Join by solvent welding or by press-to-fit<br />&bull;&nbsp;&nbsp;&nbsp; Non-toxic and safe, does not contain heavy metals or phthalates<br />&bull;&nbsp;&nbsp;&nbsp; Note: not NSF rated, should not be used for plumbing applications</p>', '<p><strong>Dimensions:</strong></p>\r\n<p><br />Actual inside diameter (in.): 0.840<br />Actual outside diameter (in.):1.04<br />Pipe Size:1/2\"<br />Product Depth (in.) : 2.5<br />Product Height (in.) : 2.5<br />Product Length (ft.): 0.2<br />Product Width (in.): 1.8<br />&nbsp;<br />&nbsp;<br /><strong>Details:</strong></p>\r\n<p><br />Application:Structural Building - Furniture<br />Features:Lead Free,UV Resistant<br />Material:PVC<br />Maximum Working Temperature (F):170<br />Maximum working pressure (psi):0<br />Minimum working temperature (F):-20<br />Pipe &amp; Tubing Product Type:Specialty<br />Pipe or Fitting Product Type:Pipe &amp; Tubing<br />Product Weight (lb.):0.2lb<br /><br /><strong>Warranty / Certificatio