(61, '{\"219\":{\"cate_parent\":\"Building Matrials\",\"cate_main\":\"Construction materials\",\"cate_list\":\"Fire & Safety\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"211\",\"cate_mid\":\"212\"}}', '', 'Fire Extinguisher', 'http://dragonmartguide.com/images/products/123_Fire_&_Safety.png', '', '', '<p>10 lb ABC Fire Extinguisher<br />ABC or multi-purpose extinguishers utilize a specially fluidized and siliconized mono ammonium phosphate dry chemical. It chemically insulates Class A fires by melting at approximately 350&deg; F and coats surface to which it is applied. It smothers and breaks the chain reaction of Class B fires and will not conduct electricity back to the operator.</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 868, 0, 28, 0, 12, '', '2017-09-25 17:07:06', '0000-00-00 00:00:00', 'on'),
