(67, '{\"248\":{\"cate_parent\":\"General\",\"cate_main\":\"Tours & Travels\",\"cate_list\":\"999\",\"cate_subcategory\":\"999\",\"cate_level\":\"2\",\"cate_pid\":\"241\",\"cate_mid\":\"0\"}}', '', 'Oriental Tours And Travel', 'http://dragonmartguide.com/images/products/172_chinawall.jpg', '[\"http://dragonmartguide.com/images/products/173_greatWall.jpg\",\"http://dragonmartguide.com/images/products/174_tours.jpg\"]', '<p>Join our authentic Small Group packages 2017/2018 and savor the true essence of real China at an extremely competitive price.</p>\r\n<p>our New Packages</p>\r\n<p>8 Days Beijing/Xian/Shanghai from $969</p>\r\n<p>10 Days Beijing/Xian/Guilin/Shanghai From $1289</p>\r\n<p>11 Days Beijing/Xian/Yangtze Cruise/Shanghai from $1699</p>', '', '0', '', '', '', '', 'Oriental', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1298, 0, 62, 0, 36, 'a:1:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-23 11:04:47\";s:6:\"rating\";s:1:\"5\";}}', '2017-09-25 17:39:54', '2017-09-26 10:55:39', 'on'),
(68, '{\"122\":{\"cate_parent\":\"Lifestyle \",\"cate_main\":\"leisure and entertainment \",\"cate_list\":\"refreshment and dining \",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"112\",\"cate_mid\":\"118\"}}', '', 'Acrobats', 'http://dragonmartguide.com/images/products/176_leisure.jpg', '[\"http://dragonmartguide.com/images/products/177_leisure&entertain.jpg\",\"http://dragonmartguide.com/images/products/179_entertainment.jpg\"]', '<p>The acrobats developed their styles based on traditional ancient arts such as dance, theater, martial arts, and magic shows. Their acrobatics is distinctive and incorporates traditional skills and physical exercises. In general, there are two styles of Chinese acrobatics: martial arts style and circus style.<br /><br />Martial arts style: The troupes that emphasize martial arts feature martial artists who often act out a fighting scene and perform with various weapons.<br /><br />Circus style shows: They are more like Western acrobatics shows. The individual performers and groups of acrobats do amazing acts of balancing, juggling, and gymnastics, and they are often amusing.</p>', '', '0', '', '', '', '', 'Acrobats', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1094, 0, 51, 0, 33, '', '2017-09-25 17:47:55', '2017-09-26 11:01:11', 'on'),
(69, '{\"149\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Office furniture\",\"cate_list\":\"Tables & Workstations\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"147\"}}', '', 'Global Office Furniture', 'http://dragonmartguide.com/images/products/182_furniture.jpg', '[\"http://dragonmartguide.com/images/products/181_officefur.jpg\",\"http://dragonmartguide.com/images/products/180_office_furniture.jpg\"]', '<p>We offer premium service for Trade Assurance orders. Learn more<br />FOB Price:&nbsp;&nbsp;&nbsp; US $800 - 890 / Set <br />Min.Order Quantity:&nbsp;&nbsp;&nbsp; 10 Set/Sets workstation<br />Supply Ability:&nbsp;&nbsp;&nbsp; 1000 Set/Sets per Month workstation<br />Port:&nbsp;&nbsp;&nbsp; Shenzhen,China<br />Payment Terms:&nbsp;&nbsp;&nbsp; L/C,T/T</p>', '', '0', '', '', '', 'Brown', 'Global', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 948, 0, 46, 0, 29, '', '2017-09-25 18:05:19', '2017-09-26 11:09:48', 'on'),
(70, '{\"175\":{\"cate_parent\":\"Food\",\"cate_main\":\"Dinning\",\"cate_list\":\"Restaurants\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"173\",\"cate_mid\":\"174\"}}', '', 'PingPangPong', 'http://dragonmartguide.com/images/products/187_food.jpg', '[\"http://dragonmartguide.com/images/products/186_dining.jpg\"]', '<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Popular choice for dim sum lunch &amp; traditional Chinese regional dishes in a contemporary setting.</span></p>', '', '0', '', '', '', '', 'PingPangPong', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 746, 0, 102, 0, 75, 'a:1:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-18 10:06:12\";s:6:\"rating\";s:1:\"4\";}}', '2017-09-25 18:11:16', '2017-09-26 18:19:31', 'on'),
(71, '{\"221\":{\"cate_parent\":\"Building Matrials\",\"cate_main\":\"Home\",\"cate_list\":\"Bathroom accessories\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"211\",\"cate_mid\":\"220\"}}', '', 'Ceramic bathroom accessories', 'http://dragonmartguide.com/images/products/188_bathroom.jpg', '[\"http://dragonmartguide.com/images/products/189_bathroomAcces.jpg\",\"http://dragonmartguide.com/images/products/190_bathroomAccess.jpg\",\"http://dragonmartguide.com/images/products/191_homeaccessories.jpg\"]', '<p>A glass top helps show off the scrolling form of this slender wrought-iron accent table.<br /><br />About $60; Pier 1 Imports</p>\r\n<p><br />Mount multiples of this simple fixture, which features a milk-glass shade, throughout the room for a soft glow.<br /><br />About $79; Pottery Barn</p>\r\n<p>A marble mosaic floor speaks to the Victorians\' fondness for tiled surfaces, while an exotic Persian rug cushions toes.<br /><br />Tile, about $20 per square foot; Cool Tiles <br />Ã¢â‚¬Â¨Wool rug, about $399; IKEA</p>', '<p>&nbsp;&nbsp;&nbsp; Home Accessories</p>\r\n<p>&nbsp;&nbsp;&nbsp; Brand Name:WeCollection<br />&nbsp;&nbsp;&nbsp; Feature:Stocked,Eco-Friendly<br />&nbsp;&nbsp;&nbsp; Type:Four-piece Set<br />&nbsp;&nbsp;&nbsp; Model Number:TJY306-4<br />&nbsp;&nbsp;&nbsp; Material:Ceramic<br />&nbsp;&nbsp;&nbsp; 1 unit:=1 Liquid bottle + 1 cup +1 Toothbrush holder + 1 Soap dispenser<br />&nbsp;&nbsp;&nbsp; Packing:polyform and box</p>', '0', '', '', '4 ', '', 'WeCollection', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1226, 0, 43, 0, 23, '', '2017-09-25 18:17:33', '2017-09-26 11:25:21', 'on'),
(72, '{\"116\":{\"cate_parent\":\"Lifestyle \",\"cate_main\":\"fashion \",\"cate_list\":\"Apparel\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"112\",\"cate_mid\":\"113\"}}', '', 'Fasion Outfits', 'http://dragonmartguide.com/images/products/192_lifestylefasionapparel.jpg', '[\"http://dragonmartguide.com/images/products/193_fashion.jpg\",\"http://dragonmartguide.com/images/products/194_outfits.jpg\"]', '<p>Looks for slim-fit or tailored-fit cuts to cast a sleeker,contemporary silhouette aroud the office . Be the sharpest dressed man in your office&nbsp; with these suits. For all the skinny men,here are some useful tips and style essentials. Follow these tips to looks great and impress everyone around you.</p>\r\n<p>1. Jackets</p>\r\n<p>2. Formal Shirts</p>\r\n<p>3. Casual T-Shirts</p>\r\n<p>4. Trousers</p>\r\n<p>&nbsp;</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1140, 0, 48, 0, 29, '', '2017-09-26 08:41:00', '2017-09-26 11:36:22', 'on'),
(73, '{\"228\":{\"cate_parent\":\"Advertising\",\"cate_main\":\"Printing & Packaging\",\"cate_list\":\"Printing machines\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"224\",\"cate_mid\":\"225\"}}', '', 'Printing Machine', 'http://dragonmartguide.com/images/products/129_Printing_machines.jpg', '', '<p>&bull;&nbsp;&nbsp;&nbsp; Exceptional build quality<br />&bull;&nbsp;&nbsp;&nbsp; Upgradeable press<br />&bull;&nbsp;&nbsp;&nbsp; Holds accurate registration<br />&bull;&nbsp;&nbsp;&nbsp; Micro registration capability<br />&bull;&nbsp;&nbsp;&nbsp; 6 Way head Levelling<br />&bull;&nbsp;&nbsp;&nbsp; No-warp steel, rubber top pallets<br />&bull;&nbsp;&nbsp;&nbsp; Range of accessories available<br />&bull;&nbsp;&nbsp;&nbsp; All head down <br />There is a difference between buying a \"cheap\" silk screen printing machine and buying a cost effective one. \"Cheap\" equipment will never provide a lasting solution for any business and will almost always need to be replaced much sooner than anticipated.<br />Why waste time and money? The Vastex V1000 press is an all steel, commercial grade, all heads down press with full micro registration capabilities.</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1093, 0, 50, 0, 29, '', '2017-09-26 08:41:23', '0000-00-00 00:00:00', 'on'),
(74, '{\"231\":{\"cate_parent\":\"Advertising\",\"cate_main\":\"Mall publications\",\"cate_list\":\"Outdoor Advertising\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"224\",\"cate_mid\":\"229\"}}', '', 'Banner Stands', 'http://dragonmartguide.com/images/products/131_Outdoor_Advertising.jpg', '', '<p>Banner stands are designed to be portable lightweight marketing displays that convey a message, service or image. Banner stands come in a wide selection of styles and sizes to suit your display and marketing needs, from indoor to outdoor, banner stands are fully versatile and can be erected in seconds and then easily stored when you have finished.</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 461, 0, 31, 0, 15, '', '2017-09-26 08:49:29', '0000-00-00 00:00:00', 'on');
