(75, '{\"251\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Home & Garden Furniture\",\"cate_list\":\"Rugs & Carpets\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"138\"}}', '', 'Carpets', 'http://dragonmartguide.com/images/products/132_rugs_and_carpets1.jpg', '[\"http://dragonmartguide.com/images/products/138_rugs-and-carpets.jpg\"]', '<p>As definition of oriental the these rugs come from eastern (Asian) traditional carpet manufacturer countries like china, vietnam and India including persia. These are hand knotted or hand woven manufactured with wool pile some time without pile. On account of durabily Orintal rugs are useful for 50-80 year without loosing its beauty and attraction. These carpets are woven very tightly weaving&nbsp; one by one knot by the weavers using wool on cotton foundation. That is why these rugs can serve for 50-80 year with beauty, charm and luster. In term of expenses these carpets are very expensive. Oriental carpets are made from expensive materials like high grade New Zealand Wool and cotton yarn except materials the weaving charges of oriental rugs are high. On account of beauty there is no alternate of oriental rug.</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1202, 0, 41, 0, 20, '', '2017-09-26 08:54:21', '2017-09-26 09:15:41', 'on'),
(76, '{\"100\":{\"cate_parent\":\"Electricals \",\"cate_main\":\"industrial equipments \",\"cate_list\":\"welding and lathe\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"81\",\"cate_mid\":\"96\"}}', '', 'Electric mig welding machine', 'http://dragonmartguide.com/images/products/133_Welding_and_lathe.jpg', '[\"http://dragonmartguide.com/images/products/134_Welding_and_lathe1.jpg\"]', '<p>Manual arc welding machine are widely used in automobile maintenance, building decoration, installation of doors and windows industry, power station auxiliary installation, billboards and other fields with the advantages of small volume, simple operation, convenient use, fast speed and strong welding advantages.</p>', '<p>Condition: New<br />Place of Origin: Shandong, China (Mainland)<br />Brand Name: Riland<br />Model Number: ZX7-500GT<br />Pulse Frequency: 50/60 HZ<br />Rated Duty Cycle: 85%<br />Motor Type: AC Motor<br />Dimensions: 535x272x463mm<br />Usage: Welding<br />Voltage: 380V<br />Certification: CE CCC<br />Warranty: 1 Year<br />After-sales Service Provided: Engineers available to service machinery overseas<br />Name: Electric mig welding machine specification<br />Input frequency(Hz): 50/60<br />Current /voltage regulation range(A/V): 40-480<br />Thrust adjustment range(A): 0-100<br />No-load voltage(V): 68<br />No-load loss(W): 80<br />Efficiency(%): 85<br />Power factor: 0.93</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 478, 0, 57, 0, 25, 'a:1:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-11-05 09:02:25\";s:6:\"rating\";s:1:\"4\";}}', '2017-09-26 09:13:26', '0000-00-00 00:00:00', 'on'),
