ast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #141414;\">Other items listed in the online baby event include travel cots and cribs, Fisher-Price toys and bathing and changing items.</span></p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1085, 0, 228, 0, 202, '', '2017-09-26 09:21:11', '0000-00-00 00:00:00', 'on'),
(78, '{\"101\":{\"cate_parent\":\"Electricals \",\"cate_main\":\"industrial equipments \",\"cate_list\":\"cleaning equipments \",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"81\",\"cate_mid\":\"96\"}}', '', '60L Carpet Cleaning Machine', 'http://dragonmartguide.com/images/products/140_cleaning_equipments.jpg', '', '<p><strong>Features:</strong></p>\r\n<p>1. The carpet cleaner is a type of machine intended for cleaning the carpet.<br />2. In one complete processes,&nbsp; it spray, purge and dry, which thoroughly clean the carpet.<br />3. The machine with wheel so easy to go where you want. The tank is 60L, big capacity to collect the dirty water.<br />4. It is especially suitable for cleaning of the large-area carpet in corridor, conference hall and restaurant. Sure without doubt it is a preferable machine for cleaning of the guestroom carpet. </p>', '<p>Type: Cyclone<br />Installation: Robot<br />Bag Or Bagless: Bagless<br />Function: Wet And Dry<br />Certification: CE<br />Power (W): 2110<br />Voltage (V): 220<br />Model Number: AC602CS/AC603CS<br />Brand Name: Vlais<br />Place of Origin: Guangdong, China (Mainland)<br />Capacity: 60L<br />Mode fo cooling: Circulating air cooling<br />Vacuum suction: 250mbar<br />pressure: 30PSI<br />power line length: 8m<br />Height: 970mm<br />Tank diameter: 440m</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 877, 0, 23, 0, 8, '', '2017-09-26 09:38:53', '0000-00-00 00:00:00', 'on'),
