(85, '{\"106\":{\"cate_parent\":\"Electricals \",\"cate_main\":\"electrical fittings and cables \",\"cate_list\":\"switches controllers \",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"81\",\"cate_mid\":\"104\"}}', '', 'Switch', 'http://dragonmartguide.com/images/products/151_Switches_and_controllers.jpg', '', '', '<p>Rider Regency is a range of wiring accessories with designer cover plates and base frame. Distinctively designed for easy installation, these plates come in various finishes, colors and textures to blend with any decor. These plates with base frame can be assembled by fixing functional modules to the base frame which is fixed onto the wall boxes. The assembly is then covered with a choice of designer cover plates</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 860, 0, 40, 0, 17, '', '2017-09-26 10:11:40', '0000-00-00 00:00:00', 'on'),
