(87, '{\"110\":{\"cate_parent\":\"Electricals \",\"cate_main\":\"power and energy products \",\"cate_list\":\"battery in UPS \",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"81\",\"cate_mid\":\"108\"}}', '', 'Powersonic Batteries', 'http://dragonmartguide.com/images/products/155_battery_and_UPS.jpg', '[\"http://dragonmartguide.com/images/products/156_battery_and_UPS1.jpg\"]', '<p>Power Sonic PS-1250 12V 5Ah : Absorbant Glass Mat (AGM) technology for superior performance. Valve regulated, spill proof construction allows safe operation in any position.<br />Common uses for the PS-1250: Consumer Electronics, Electric Vehicles, Engine Starters, Golf Carts, Hunting, Lawn and Garden Tools, Medical Mobility, Motorcycles, Photography, Power sports, Portable Tools, Solar, Toys and Hobby, Access Control Devices, Emergency Lighting, Security</p>', '<p><br />This PS-1250 is a sealed lead-acid (SLA) absorbed glass mat (AGM) rechargeable battery. AGM and GEL batteries are lead-acid and of the same battery chemistry. This battery comes already charged, sealed, maintenance free, and ready to install. Premium quality absorbed glass mat technology (AGM) is ideal for ATVs, motorcycles, personal watercraft, snowmobiles, UPS systems, alarm systems, exit lighting systems, wheelchairs and more.</p>\r\n<p>&bull;&nbsp;&nbsp;&nbsp; Brand: Power-Sonic<br />&bull;&nbsp;&nbsp;&nbsp; MFG Part: PS-1250<br />&bull;&nbsp;&nbsp;&nbsp; SKU: 3295149</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 625, 0, 144, 0, 68, 'a:4:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-17 14:51:52\";s:6:\"rating\";s:1:\"4\";}i:1;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-18 10:17:38\";s:6:\"rating\";s:1:\"4\";}i:2;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-26 08:34:47\";s:6:\"rating\";s:1:\"1\";}i:3;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-11-05 09:01:46\";s:6:\"rating\";s:1:\"5\";}}', '