(89, '{\"111\":{\"cate_parent\":\"Electricals \",\"cate_main\":\"power and energy products \",\"cate_list\":\"Solar Power Plant products \",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"81\",\"cate_mid\":\"108\"}}', '', 'Solar Panels', 'http://dragonmartguide.com/images/products/163_solar_power_plant_products.jpg', '[\"http://dragonmartguide.com/images/products/164_solar_power_plant_products1.jpg\"]', '<p><strong>Detailed Information</strong><br /><br /><strong>Solartech J-Series Modules</strong> <br /><br />Solartech photovoltaic J-Series Modules are constructed with high efficient polycrystalline solar cells and produce higher output per module than others in it class. This industrial grade module is an industry standard among various industry professionals.</p>\r\n<p><br /><strong>Features</strong><br />&bull;&nbsp;&nbsp;&nbsp; Class 1, Division 2, (C1D2) Group A,B,C and D<br />&bull;&nbsp;&nbsp;&nbsp; Accessible junction box with 4-1/2\" knockout for ease of installation. <br />&bull;&nbsp;&nbsp;&nbsp; (EVA) with TPT cushions the solar cells within the laminate an ensures the operating characteristics of the solar cells under virtually any climatic condition<br />&bull;&nbsp;&nbsp;&nbsp; Rigid anodized aluminum frame and low iron tempered glass <br />&bull;&nbsp;&nbsp;&nbsp; Easily accessible grounding points on all four corners for fast installation<br />&bull;&nbsp;&nbsp;&nbsp; Proven junction box technology<br /><br /><strong>Applications</strong><br />&bull;&nbsp;&nbsp;&nbsp; Traffic &amp; Safety<br />&bull;&nbsp;&nbsp;&nbsp; Federal Government<br />&bull;&nbsp;&nbsp;&nbsp; Oil &amp; Gas<br />&bull;&nbsp;&nbsp;&nbsp; Security<br />&bull;&nbsp;&nbsp;&nbsp; Telecommunications<br />&bull;&nbsp;&nbsp;&nbsp; Water and Wastewater<br />&bull;&nbsp;&nbsp;&nbsp; Weather &amp; Environmental Monitoring<br />&bull;&nbsp;&nbsp;&nbsp; RV Camper<br />&bull;&nbsp;&nbsp;&nbsp; Emergency Power<br />&bull;&nbsp;&nbsp;&nbsp; Telemetry<br />&bull;&nbsp;&nbsp;&