(90, '{\"152\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Office furniture\",\"cate_list\":\"curtains & blinds\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"147\"}}', '', 'Chinese Curtains', 'http://dragonmartguide.com/images/products/165_curtains.jpg', '[\"http://dragonmartguide.com/images/products/166_chinaCurtain.jpg\",\"http://dragonmartguide.com/images/products/167_newcurtaintypes.jpg\"]', '<p>There are plenty of reasons why you are searching for information about shower curtains montreal, and surely, you are searching for fresh ideas for your needs. We determined this online sources and we suppose this is one of many wonderful material for reference. And you know, initially when I first found it, we loved it, we hope you are too. We know, we might own different thoughts, but, what we do just want to assist you in finding more recommendations concerning shower curtains montreal.</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1069, 0, 31, 0, 10, '', '2017-09-26 10:45:38', '0000-00-00 00:00:00', 'on'),
(91, '{\"116\":{\"cate_parent\":\"Lifestyle \",\"cate_main\":\"fashion \",\"cate_list\":\"Apparel\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"112\",\"cate_mid\":\"113\"}}', '', 'Jackets', 'http://dragonmartguide.com/images/products/168_Apparel.JPG', '[\"http://dragonmartguide.com/images/products/169_Apparel1.JPG\"]', '<p>A real favorite among the crew during last summers field-testing. The Alta Wind shirt is a hybrid between a shirt and an outshell windbreaker.</p>\r\n<p><br /><strong>Details:</strong></p>\r\n<p><br />Manufactured from strong Nylon fabric, it&rsquo;s designed with a roomy fit and a full-length zipper in the front. This shirt is soft enough to be worn straight next to the skin, yet wind-, UV- and mosquito-proof.<br /><br />On either side of the chest are external top entry-pockets with push button closure. They are large enough to hold trout-sized fly boxes. There is also a pen/sunglass pocket on the right side and a further vertical pocket with zipper closure on the left chest. There are D-rings in the neck and under the lid of the left side chest pocket. There is a ventilating mesh panel in the back of the shoulders and the sleeves have hidden roll-up fixtures. </p>', '<p>Fabric: 100% Nylon.<br />Color: Clear Blue, Charcoal.<br />Weight: 224 grams in size L.<br />Sizes: S &ndash; XXXL.</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1280, 0, 35, 0, 18, '', '2017-09-26 10:49:16', '0000-00-00 00:00:00', 'on'),
