(93, '{\"136\":{\"cate_parent\":\"Lifestyle \",\"cate_main\":\"Arts and crafts \",\"cate_list\":\"sculptures\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"112\",\"cate_mid\":\"130\"}}', '', 'Roman Lady Sculpture', 'http://dragonmartguide.com/images/products/183_sculputure.jpg', '[\"http://dragonmartguide.com/images/products/184_sculputure1.jpg\"]', '<p>These roman lady sculpture are crafted and carved by very experienced artisans due to which these moorties are widely demanded and liked by all. These roman lady sculpture are available in various elegant designs and patterns. Festive rosettes crown a soapstone elephant couple</p>\r\n<p><br /><strong>Details:</strong></p>\r\n<p><br />Festive rosettes crown a soapstone elephant couple, carved in India\'s legendary jail openwork. Gulam Rasool masterfully sculpts the expressive pachyderms, creating miniature elephants inside each.</p>', '<p>&bull;&nbsp;&nbsp;&nbsp; 2.7 lbs<br />&bull;&nbsp;&nbsp;&nbsp; Big elephant: 3.9\" H x 5\" W x 3.5\" D<br />&bull;&nbsp;&nbsp;&nbsp; Medium elephant: 3.2\" H x 3.9\" W x 2.8\" D<br />&bull;&nbsp;&nbsp;&nbsp; Soapstone<br />&bull;&nbsp;&nbsp;&nbsp; Natural stone - some variations in color and/or pattern are to be expected</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1077, 0, 30, 0, 12, '', '2017-09-26 11:13:36', '0000-00-00 00:00:00', 'on');
