(94, '{\"208\":{\"cate_parent\":\"Toys & Kids\",\"cate_main\":\"Kids\",\"cate_list\":\"Kids Play area items\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"198\",\"cate_mid\":\"205\"}}', '', 'Kidzone', 'http://dragonmartguide.com/images/products/109_kids_play_area_items.jpg', '[\"http://dragonmartguide.com/images/products/110_kids_play_area_items1.jpg\"]', '<p>&bull;&nbsp; Built -In Activity board that features a picture house, spinning balls &amp; play phone <br />&bull;&nbsp; Activity Board Picture House, Play Phone, Spinning Balls <br />&bull;&nbsp; Assembled Dimension: 8 Panels Assembled Diameter 74\" Inches <br />&bull;&nbsp; BPA and LEAB free <br />&bull;&nbsp; Individual Panels : 31\" (W) X 23.5\"(H)</p>\r\n<p><strong>Features:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; 2 play decks&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Play deck heights: 5\' and 7\'&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 3\' x 5\' balcony&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Balcony height: 5\'&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Wood roof&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Turbo tube slide&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Two 14\' heavy duty, double wall wave slides&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 1 tire swing with plastisol coated chain &amp; ball bearing 360 swivel&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 3 belt swings&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 1 rock climbing wall with rock grips&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 1 telescope&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 1 steering wheel&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 2 safety handles </p>', '<p>Construction &amp; Specifications:<br />&bull;&nbsp;&nbsp;&nbsp; This unit is for residential use only&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Constructed with 100% redwood, stained for lasting richness&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 5\' x 5\' play deck with 5\' deck height&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 5\' x 5\' play deck with 7\' deck height&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 3\' x 5\' balcony with 5\' deck height&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Sturdy 4\" x 6\" deck supports with 2\" x 6\" decking&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Solid 4\" x 4\" frame design with 4\" x 6\" swing beam rated at 250 lbs. per swing&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Spacious 3-position swing beam for safe swinging&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Commercial-grade swing hangers with safety clips for adjustability&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Heavy-duty, 1-piece molded swing belts with reinforced nylon grommets &amp; UV protection to resist fading; matching plastisol coated \'pinch-free\' chains that stay cool to the touch and won\'t fray or rust&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 100% nut/bolt and screw construction. No nails or staples&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Safety step ladder, inclined with wide flat 2\" x 6\" ladder steps&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Made in the USA&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Recommended for ages 3 - 11&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Overall dimensions 34\' L x 15\' W x 13\' H&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Approximate weight 1,773 lbs.</p>', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 1122, 0, 54, 0, 23, 'a:1:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-30 21:57:52\";s:6:\"rating\";s:1:\"5\";}}', '2017-09-26 11:53:40', '0000-00-00 00:00:00', 'on'),
