(100, '{\"206\":{\"cate_parent\":\"Toys & Kids\",\"cate_main\":\"Kids\",\"cate_list\":\"Baby & Kids items\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"198\",\"cate_mid\":\"205\"}}', '', 'Kids footwear', 'http://dragonmartguide.com/images/products/221_kids_footwear.jpg', '', '<p>As per the varied requirements of clients, we are offering a wide gamut of Kids Footwear. These footwears are designed using optimum quality basic material and contemporary technology under the guidance of skilled designers. We manufacture these footwears in various design and size in order to meet the various requirements of clients. Apart from this, clients can avail our offered comfort flats from us at market leading prices.<br /><br /><strong>Features:</strong><br /><br />&nbsp; 1.&nbsp; Fine finish<br />&nbsp; 2.&nbsp; Optimum Quality<br />&nbsp; 3.&nbsp; Stylish</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 132, 0, 161, 0, 40, '', '2017-10-01 17:21:04', '0000-00-00 00:00:00', 'on'),
(101, '{\"114\":{\"cate_parent\":\"Lifestyle \",\"cate_main\":\"fashion \",\"cate_list\":\"Garments\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"112\",\"cate_mid\":\"113\"}}', '', 'Embroidery wedding gown', 'http://dragonmartguide.com/images/products/222_embroidery_wedding_gown.jpg', '[\"http://dragonmartguide.com/images/products/223_embroidery_wedding_gown_1.jpg\",\"http://dragonmartguide.com/images/products/224_embroidery_wedding_gown_2.jpg\",\"http://dragonmartguide.com/images/products/225_embroidery_wedding_gown_3.jpg\"]', '<p>Along with our range of adorable wedding gowns, we also have Hand Embroidered Wedding Gowns. These hand embroidered wedding gowns are very delicate and sophisticated looking with which are carefully handmade and crafted. Our hand embroidered wedding gowns are very efficient to use with very smooth and soft fabric embellished with beautiful sparkly designs that are truly eye pleasing. Avail from us our hand embroidered wedding gowns at economical range of prices.<br /><br /><br /><strong>Features:</strong><br /><br />&nbsp;&nbsp;&nbsp; 1. Best quality<br />&nbsp;&nbsp;&nbsp; 2. Premium durability<br />&nbsp;&nbsp;&nbsp; 3. Very elegant<br />&nbsp;&nbsp;&nbsp; 4. Long lasting<br /><br /></p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 132, 0, 155, 0, 34, '', '2017-10-01 17:40:40', '0000-00-00 00:00:00', 'on'),
