(111, '{\"151\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Office furniture\",\"cate_list\":\"reception furniture\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"147\"}}', '', 'Reception furniture', 'http://dragonmartguide.com/images/products/250_reception_reception_1.jpg', '[\"http://dragonmartguide.com/images/products/249_reception_furniture_2.jpg\",\"http://dragonmartguide.com/images/products/248_reception_furniture.jpg\"]', '<p>This up to the minute design combination of very deep and slimline upholstery brings a new aesthetic into the arena of reception seating.<br /><br />The comfort is further enhanced through the resilience of the backrest mounting.</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 78, 0, 88, 0, 54, 'a:1:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-11-05 15:51:07\";s:6:\"rating\";s:1:\"3\";}}', '2017-10-04 15:15:58', '0000-00-00 00:00:00', 'on'),
(112, '{\"148\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Office furniture\",\"cate_list\":\"Chairs & benches\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"147\"}}', '', 'Table and Chair', 'http://dragonmartguide.com/images/products/251_chair_table.jpg', '[\"http://dragonmartguide.com/images/products/252_chair_table_1.jpg\",\"http://dragonmartguide.com/images/products/253_chair_table_2.jpg\",\"http://dragonmartguide.com/images/products/254_chair_table_3.jpg\"]', '<p>This office table and chair set is beautiful for choosing right office furniture. The design of your office layout can reflect your corporate culture and mission. You should tailor your office layouts and designs to complement the type of atmosphere you want to achieve. Whether you&rsquo;re planning a old office design or a modern office design, the office table and chair set will make the greatest difference.</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 78, 0, 87, 0, 53, 'a:1:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-18 18:09:15\";s:6:\"rating\";s:1:\"5\";}}', '2017-10-04 15:19:38', '0000-00-00 00:00:00', 'on'),
(113, '{\"166\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Interior & Decorative Furniture\",\"cate_list\":\"Interior Furniture\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"165\"},\"167\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Interior & Decorative Furniture\",\"cate_list\":\"Decorative Furniture\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"165\"},\"168\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Interior & Decorative Furniture\",\"cate_list\":\"Doors & Windows\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"165\"}}', '', 'Office furnitures', 'http://dragonmartguide.com/images/products/255_office_furniture.jpg', '[\"http://dragonmartguide.com/images/products/256_office_furniture_1.jpg\",\"http://dragonmartguide.com/images/products/257_office_furniture_2.jpg\",\"http://dragonmartguide.com/images/products/258_office_furniture_3.jpg\",\"http://dragonmartguide.com/images/products/259_office_furniture_4.jpg\"]', '<p>With affordable home office furniture offered in contemporary, traditional and casual styles, Fotivo Furniture has everything required to put together a functional home workspace. Table desks, double pedestal desks, single pedestal desks, computer desks, roll top desks and secretary desks are available in painted or wood finishes, and combine with a diverse selection of office seating &ndash; desk chairs, task chairs, side chairs, executive chairs, upholstered office chairs and swivel chairs &ndash; to form the perfect pair. Office storage solutions include filing cabinets, lateral filing cabinets, bookcases, credenzas and more. Coaster also offers complete youth desk sets, computer workstations, executive desks and L-shaped desk sets.</p>', '', '0', '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 78, 0, 82, 0, 48, 'a:1:{i:0;a:3:{s:6:\"userid\";s:0:\"\";s:9:\"createdAt\";s:19:\"2017-10-14 1