(38, 'insert', 'add_product', 'product_details', 13, 6, 'INSERT INTO `product_details` (`prodt_id`, `prodt_category`, `prodt_codeno`, `prodt_name`, `prodt_picture`, `prodt_newpics`, `prodt_description`, `prodt_specifications`, `prodt_price`, `prodt_size`, `prodt_avail_quantity`, `prodt_unite_type`, `prodt_avail_color`, `prodt_brand`, `prodt_offer_type`, `prodt_offer`, `prodt_offer_from`, `prodt_offer_to`, `prodt_offer_times`, `prodt_company_id`, `prodt_fav_count`, `prodt_views_count`, `prodt_offer_views`, `prodt_click_count`, `prodt_ranking`, `prodt_cre`, `prodt_modi`, `prodt_status`) VALUES (NULL, \'{\"142\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Home & Garden Furniture\",\"cate_list\":\"Matress & pillows\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"138\"}}\', \'\', \'Intex Queen 18\" Raised Pillow Rest Airbed Mattress\', \'http://dragonmartguide.com/images/products/33_mattress-and-pillows-new.jpg\', \'[\"http:\\/\\/beta.dragonmartguide.com\\/images\\/products\\/32_mattress_and_pillows1.jpeg\"]\', \'<p>The Intex Raised Airbed is perfect for the home, dorm room and even camping. Its waterproof, flocked top provides a luxurious sleeping surface, while keeping the sheets in place. The mattress is raised 18 inches from the floor for convenience. <br /><br /><strong>Benefits:</strong><br />&nbsp;<br />&bull;&nbsp;&nbsp;&nbsp; 3 year guarantee<br />&bull;&nbsp;&nbsp;&nbsp; Classic rectangular shaped pillow<br />&bull;&nbsp;&nbsp;&nbsp; Fits a standard pillow case<br />&bull;&nbsp;&nbsp;&nbsp; The soft textured cover is removable for washing at 60&deg;C and is quick drying<br />&bull;&nbsp;&nbsp;&nbsp; Cover meets Oeko-Tex&reg; 100 standard. It has been tested for harmful substances and poses no risks to health<br />&bull;&nbsp;&nbsp;&nbsp; Additional or spare covers may be purchased separately<br />&bull;&nbsp;&nbsp;&nbsp; Luxury 100% cotton TEMPUR-FIT&trade; Pillow Cases also available in 2 colours (optional)<br />&bull;&nbsp;&nbsp;&nbsp; Daily fluffing and puffing will help to maintain this product<br />&bull;&nbsp;&nbsp;&nbsp; Co-ordinates with mattresses from the Original Collection<br />&bull;&nbsp;&nbsp;&nbsp; Smaller items are sent direct to you by courier unless they have been ordered with a mattress or bed</p>\', \'<p><strong>Intex Queen 18\\\" Raised Pillow Rest Airbed Mattress:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Perfect for the home, dorm room and even camping<br />&bull;&nbsp;&nbsp;&nbsp; Waterproof, flocked top<br />&bull;&nbsp;&nbsp;&nbsp; Flocked top keeps the sheets in place<br />&bull;&nbsp;&nbsp;&nbsp; Raised 18\\\" from the floor for convenience<br />&bull;&nbsp;&nbsp;&nbsp; Measures: 64\\\"L x 82\\\"W x 18\\\"H<br />&bull;&nbsp;&nbsp;&nbsp; Model# 67719WL</p>\r\n<p><br />Made from a patented TEMPUR envelope containing thousands of TEMPUR micro-cushions, the Comfort Pillow Original provides plush comfort whilst still maintaining that all so important pressure relief.&nbsp; Just so you can get really comfortable you can fluff and puff the TEMPUR Comfort Pillow Original just the way you want it, and dress it up in your favourite bed linen because it fits easily in to a standard pillow case. The soft fabric cover also meets Oeko-Tex&reg; 100 standard. This means it has been tested for harmful substances and poses no risk to health. </p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'1113\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-24 11:49:24\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-24 11:49:24', 'delete'),
