'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'1150\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-24 11:58:39\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-24 11:58:39', 'delete'),
