(53, 'insert', 'add_product', 'product_details', 18, 6, 'INSERT INTO `product_details` (`prodt_id`, `prodt_category`, `prodt_codeno`, `prodt_name`, `prodt_picture`, `prodt_newpics`, `prodt_description`, `prodt_specifications`, `prodt_price`, `prodt_size`, `prodt_avail_quantity`, `prodt_unite_type`, `prodt_avail_color`, `prodt_brand`, `prodt_offer_type`, `prodt_offer`, `prodt_offer_from`, `prodt_offer_to`, `prodt_offer_times`, `prodt_company_id`, `prodt_fav_count`, `prodt_views_count`, `prodt_offer_views`, `prodt_click_count`, `prodt_ranking`, `prodt_cre`, `prodt_modi`, `prodt_status`) VALUES (NULL, \'{\"148\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Office furniture\",\"cate_list\":\"Chairs & benches\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"147\"}}\', \'\', \'Chairs\', \'http://dragonmartguide.com/images/products/42_chairs_and_benches.jpg\', \'[\"http:\\/\\/beta.dragonmartguide.com\\/images\\/products\\/43_chairs_and_benches1.jpg\"]\', \'<p>The Bathroom Safety Shower Chair by Drive Medical is guaranteed to improve your bathing experience. The back, seat and legs snap together making assembly a cinch without tools. Manufactured with a corrosion proof durable aluminum frame which is strong and lightweight, this product provides maximum safety in the bathroom. The seat and back were developed using recycled materials and were ergonomically designed with curves to offer support and add comfort. The seat has holes to allow for drainage and handles in order to reduce the risk of slipping. The shower chair has angled legs with suction style tips providing extra stability. An additional feature of this chair is that the legs are height adjustable in order to meet your specific needs. The product comes with or without a backrest and in four attractive colors: grey, blue, teal and yellow but no matter the color, this Bathroom Safety Shower Tub Chair will make a great addition to your home.</p>\r\n<p><strong>Features</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Aluminum frame is lightweight, durable and corrosion proof <br />&bull;&nbsp;&nbsp;&nbsp; Angled legs with suction style tips provide additional stability <br />&bull;&nbsp;&nbsp;&nbsp; Drainage holes in seat reduce slipping <br />&bull;&nbsp;&nbsp;&nbsp; Easy to clean <br />&bull;&nbsp;&nbsp;&nbsp; Easy, tool free assembly of seat and legs <br />&bull;&nbsp;&nbsp;&nbsp; Environment friendly product <br />&bull;&nbsp;&nbsp;&nbsp; Pinch free cover allows for push pins to be depressed without pinching fingers; the audible \\\"click\\\" will be heard when secure <br />&bull;&nbsp;&nbsp;&nbsp; Support collar prevents leg movement<br />&bull;&nbsp;&nbsp;&nbsp; Wrought iron furniture, that are usually used for patio and garden decorating, come into modern homes, creating a new trend in interior decorating with metal chairs and benche<br /><br /></p>\', \'\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'1124\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-24 12:58:19\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-24 12:58:19', 'on'),
