Room&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; :&nbsp;&nbsp;&nbsp;&nbsp; Living Room<br />Brand&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp; Uenjoy&nbsp;&nbsp;&nbsp; <br />Height&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; : &nbsp;&nbsp;&nbsp; 120 cm<br />MPN&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; :&nbsp; &nbsp;&nbsp;&nbsp; 21100070&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; </p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'1315\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-24 13:20:02\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-24 13:20:02', 'delete'),
