(62, 'insert', 'add_product', 'product_details', 21, 6, 'INSERT INTO `product_details` (`prodt_id`, `prodt_category`, `prodt_codeno`, `prodt_name`, `prodt_picture`, `prodt_newpics`, `prodt_description`, `prodt_specifications`, `prodt_price`, `prodt_size`, `prodt_avail_quantity`, `prodt_unite_type`, `prodt_avail_color`, `prodt_brand`, `prodt_offer_type`, `prodt_offer`, `prodt_offer_from`, `prodt_offer_to`, `prodt_offer_times`, `prodt_company_id`, `prodt_fav_count`, `prodt_views_count`, `prodt_offer_views`, `prodt_click_count`, `prodt_ranking`, `prodt_cre`, `prodt_modi`, `prodt_status`) VALUES (NULL, \'{\"151\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Office furniture\",\"cate_list\":\"reception furniture\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"147\"}}\', \'\', \'Reception Table\', \'http://dragonmartguide.com/images/products/49_reception-table1.png\', \'[\"http:\\/\\/beta.dragonmartguide.com\\/images\\/products\\/48_reception-table.png\"]\', \'<p>In a zest to accomplish utmost approval and consent of the patrons, we provide the handpicked quality of Wooden Reception Table. Appreciated for its regal look, alluring design and smooth finishing, the reception table is designed in accordance to the latest market trends. In order to meet and manage the diverse needs of the patrons, the reception table is available with us in various designs and sizes. <br /><br /><strong>Features:</strong><br />&bull;&nbsp;&nbsp;&nbsp; Contemporary design<br />&bull;&nbsp;&nbsp;&nbsp; Perfect finishing and smooth texture<br />&bull;&nbsp;&nbsp;&nbsp; Portable and lightweight<br />&bull;&nbsp;&nbsp;&nbsp; Eye-catching appearance<br /><br />&bull;&nbsp;&nbsp;&nbsp; Counterwise Reception Unit<br />&bull;&nbsp;&nbsp;&nbsp; The Counterwise reception unit makes a dramatic first impression.&nbsp; Modular desk top perforated panels designed to fit standard desk tops.&nbsp; These units can be in black or silver perforated panels with any colour melamine top.<br />&bull;&nbsp;&nbsp;&nbsp; The counterwise unit consists of 2 x 1500mm desk with full modesty, 800x800mm corner link,&nbsp; 4 x link plates, 2 x 1500 counter tops, and 1 x 800 curved counter top.&nbsp; Drawers are excluded</p>\r\n<p>The reception table a well designed furniture enhance the looks of your reception area and also designed aptly to look in to the various needs of your reception personell as well as the clients they receive. The reception table will be able to handle various operations like communications, and customer handling. The counter raiser with contrast color adds to the beauty of this reception table. The counter raiser also helps give good writing platform to the custormer and sufficient privacy of work to the personnel.</p>\r\n<p>&nbsp;</p>\', \'<p>Minimum Order Quantity&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1 Piece<br />Size&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :&nbsp; &nbsp;&nbsp; 1800X600X1200<br />Color&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Highlandpine,dark akasia,light akasia,wenge,beech,dark grey,light gray,off white.<br />Design Type&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; &nbsp;&nbsp; Standard<br />Brand&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp; &nbsp;&nbsp; Nicewood</p>\r\n<p><strong>Additional Information:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Item Code&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : &nbsp; &nbsp;&nbsp;&nbsp; NR-04<br />&bull;&nbsp;&nbsp;&nbsp; Port of Dispatch&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp; &nbsp;&nbsp;&nbsp; Standard<br />&bull;&nbsp;&nbsp;&nbsp; Production Capacity&nbsp; : &nbsp; &nbsp;&nbsp;&nbsp; 20PC/Day<br />&bull;&nbsp;&nbsp;&nbsp; Delivery Time&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3-4 Week<br />&bull;&nbsp;&nbsp;&nbsp; Packaging Details&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp; &nbsp; &nbsp; Standard</p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'1063\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-24 14:04:04\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-24 14:04:04', 'on'),
