(65, 'insert', 'add_product', 'product_details', 22, 6, 'INSERT INTO `product_details` (`prodt_id`, `prodt_category`, `prodt_codeno`, `prodt_name`, `prodt_picture`, `prodt_newpics`, `prodt_description`, `prodt_specifications`, `prodt_price`, `prodt_size`, `prodt_avail_quantity`, `prodt_unite_type`, `prodt_avail_color`, `prodt_brand`, `prodt_offer_type`, `prodt_offer`, `prodt_offer_from`, `prodt_offer_to`, `prodt_offer_times`, `prodt_company_id`, `prodt_fav_count`, `prodt_views_count`, `prodt_offer_views`, `prodt_click_count`, `prodt_ranking`, `prodt_cre`, `prodt_modi`, `prodt_status`) VALUES (NULL, \'{\"152\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Office furniture\",\"cate_list\":\"curtains & blinds\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"147\"}}\', \'\', \'Curtains\', \'http://dragonmartguide.com/images/products/50_curtains_&_blinds.jpg\', \'[\"http:\\/\\/beta.dragonmartguide.com\\/images\\/products\\/51_curtains_&_blinds1.jpeg\"]\', \'<p><strong>Vertical blinds\\\' introduction</strong><br />&nbsp;<br />1.&nbsp; Vertical blinds adopts plummet leaf type structure,the leafs can rotate 180 degrees, not only can adjust indoor light freely but also ventilate the room and shading.<br />&nbsp;<br />2.&nbsp; Rail made of high quality aluminum alloy section bar, smooth opening and closing, surface oxidation and dull polish processing, fine and smooth, durable and durable;<br />&nbsp;<br />3. Lead rail 4 level gears regulating stem made of 5mm aluminum core, fixed by pure copper blind nuts and engineering plastic. <br /><br /><strong>Features:</strong><br /><br />1. The Ceiling Mounted Hospital Curtains Systems are widely used in the hospitals.<br />2. Being Ventilated: On the top of the Ward Curtains, there are reticular and oval holes for ventilation. Air or winds can go through this part to keep a good ventilation environment.<br />3. Being Neat: Ward Curtains used in Normal Wards, Intensive Care Units, Injection Rooms, Body Examine Room, etc. to make the palce orderly and neat.<br />4. Keep Privacy: The patients, the visitors in the same wards or rooms to keep their privacy by the Ward Curtains<br />5. Saving Space: Ward Curtains system is ceiling mounted, Can be fold-able. Needn&rsquo;t any additional space.<br />6. Being Convenient to install: the Wards Curtains System tracks can be installed easily, and the curtains can be offload; easy to clean.<br />7.Fireproofness: Compliant with GB17591-1998 standard Both fireproofing and non-fireproofing medical separating curtain cloth is available.<br />With the help of rich industry experience and skilled team of professionals, we are offering Vertical Blinds. </p>\r\n<p><strong>Uses:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Used as curtains<br /><br /><br /></p>\', \'<p>Type: vertical</p>\r\n<p><strong>Applications:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Both residential and commercial areas</p>\r\n<p><strong>Features:</strong></p>\r\n<p><br />&bull;&nbsp;&nbsp;&nbsp; Simple installation <br />&bull;&nbsp;&nbsp;&nbsp; Less maintenance required <br />&bull;&nbsp;&nbsp;&nbsp; Light weight</p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'1056\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-24 14:11:10\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-24 14:11:10', 'delete');
