are<br /><br /></p>\', `prodt_specifications` = \'\', `prodt_size` = \'\', `prodt_avail_quantity` = \'\', `prodt_unite_type` = \'\', `prodt_avail_color` = \'\', `prodt_brand` = \'\', `prodt_modi` = \'2017-09-25 10:59:08\', `prodt_status` = \'approval\' WHERE `product_details`.`prodt_id` = \'40\'', '2017-09-25 10:59:08', 'on'),
