(136, 'insert', 'add_product', 'product_details', 45, 6, 'INSERT INTO `product_details` (`prodt_id`, `prodt_category`, `prodt_codeno`, `prodt_name`, `prodt_picture`, `prodt_newpics`, `prodt_description`, `prodt_specifications`, `prodt_price`, `prodt_size`, `prodt_avail_quantity`, `prodt_unite_type`, `prodt_avail_color`, `prodt_brand`, `prodt_offer_type`, `prodt_offer`, `prodt_offer_from`, `prodt_offer_to`, `prodt_offer_times`, `prodt_company_id`, `prodt_fav_count`, `prodt_views_count`, `prodt_offer_views`, `prodt_click_count`, `prodt_ranking`, `prodt_cre`, `prodt_modi`, `prodt_status`) VALUES (NULL, \'{\"193\":{\"cate_parent\":\"Industrial\",\"cate_main\":\"Machinaries\",\"cate_list\":\"Laser & Engraving machines\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"183\",\"cate_mid\":\"189\"}}\', \'\', \'laser engrave machine \', \'http://dragonmartguide.com/images/products/97_laser_engraving_machines1.jpg\', \'\', \'<p><strong>Features laser engrave machine :</strong></p>\r\n<p><br />1) Advanced DSP Digital Control technology .<br />2) Original Imported Straight Linear Guide Rail X. Y axis Makes the Machine Running on a high Speed and Precision.<br />3) Imported Reflected Lens and focus lens in the Optical System Can greatly Reduce the heat loss<br />4) High Quality CO2 Glass Sealed Laser tube Provides Strong Stable Laser beam mode and Longer Service Life.<br />5) The Laser tube adopts Compulsive Water Cooling System, Water Pump Can Control the temperature Automatically,<br />6) High Compatibility, Applicable for the Models Like PLT,BMP,DXF,DST,etc.<br />7) LEETRO Control Panel in English.<br />8) Equipped with Hydraulic protection,Exhaust dust and smoke device,the huff protection.<br />9) Optional Up &amp; down adjustable worktable can Engrave and Cut Different Height Materials</p>\r\n<p><br /><strong>Technical Parameters laser engrave machine :</strong></p>\r\n<p><br /><strong>NO.&nbsp;&nbsp;&nbsp; Description&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Parameter</strong> <br />1&nbsp;&nbsp;&nbsp; Engraving area&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1300X900mm<br />2&nbsp;&nbsp;&nbsp; Laser power&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; 80W(60W/100W/130W/150W)<br />3&nbsp;&nbsp;&nbsp; Engraving speed&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; 0-60000mm/min<br />4&nbsp;&nbsp;&nbsp; Cutting speed&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 0-5000mm/min<br />5&nbsp;&nbsp;&nbsp; Power supply &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \\\"220V/50HZ , 110V/60HZ<br />6&nbsp;&nbsp;&nbsp; Position accuracy&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; 0.01mm<br />7&nbsp;&nbsp;&nbsp; Repetition accuracy&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 0.02mm<br />8&nbsp;&nbsp;&nbsp; Guide rail&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; Hiwin from Taiwan<br />9&nbsp;&nbsp;&nbsp; Transmission method&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Belt transmission<br />10&nbsp;&nbsp;&nbsp; Software supported&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; CorelDraw, PhotoShop, AutoCAD,TAJIMA<br />11&nbsp;&nbsp;&nbsp; Driving system&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp; Leashine driving system and stepper motor<br />12&nbsp;&nbsp;&nbsp; Net Weight&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; 240kg<br />13&nbsp;&nbsp;&nbsp; Optional part&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Partial up-down work table , USB port, autofocus<br />14&nbsp;&nbsp;&nbsp; Graphic format supported&nbsp;&nbsp;&nbsp; BMP,HPGL(PLT),JPEG,GIF,TIFF,PCS,TGA</p>\', \'<p>Laser marking system with a high speed scanner system.The software with various functions and a good operation interface, for example, Layered setting, layered operation, red light preview.It can be used with AutoCAD,CorelDRAW,Photoshop and a variety of softwares output, and can layout and modify differentformats like characters, symbol, graphics, bar code, two dimensional barcode and serial number, support PLT, PCX. AL.DXF. BMP, JPG and so on many kinds of Ã¯Â¬Â le formats, can use directly TIF. SHX word data</p>\r\n<p><strong>Product Parameters:</strong></p>\r\n<p><br />&nbsp;The whole power&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :&nbsp; &nbsp;&nbsp; &le;650W<br />&nbsp;Power supply&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp; 220V&plusmn;10%/50Hz/4A<br />&nbsp;Lifetime of laser module&nbsp;&nbsp;&nbsp; :&nbsp; &gt;50000h<br />&nbsp;Cooling type &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; :&nbsp; Air cooled<br />&nbsp;Working environment&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; : Clean or dust less indoor<br />&nbsp;Working temperature&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; : 10&deg;C~40&deg;C<br />&nbsp;Working humidity&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : 5%~75%(no condensation)<br />&nbsp;Power supply &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : AC 220V 50Hz, 10A air switch, voltage stabilization<br />&nbsp;The whole weight&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; :&nbsp; &nbsp; 150KG<br />&nbsp;Appearance size&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 700&times;900&times;1380mm<br />&nbsp;Laser power &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; :&nbsp; 10W/20W<br />&nbsp;Laser wavelength&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; : 1065&plusmn;10nm<br />&nbsp;Beam quality&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &lt;2<br />&nbsp;Repeat frequency&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :&nbsp; 20KHz~100KHz<br />&nbsp;Marking area &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : &nbsp; customized design<br />&nbsp;Marking speed&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :&nbsp; &le;7000m/s<br />&nbsp;Marking depth&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : &nbsp; &le;0.5mm<br />&nbsp;Min. line width &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; :&nbsp; 0.02mm<br />&nbsp;Min. character&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; :&nbsp; 0.15mm<br />&nbsp;Repeatable accuracy &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; : &nbsp; &plusmn;0.002mm</p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'836\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-25 12:11:30\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-25 12:11:30', 'on'),
