(138, 'insert', 'ajax_image_uploads', 'pictures', 99, 6, 'INSERT INTO `pictures` (`pic_id`, `pic_category`, `pic_userid`, `pic_username`, `pic_picture`, `pic_type`, `pic_linked`, `pic_cre`, `pic_status`) VALUES (NULL, \'product\', \'6\', \'website@webappi.com\', \'99_Hydraulic--&-pneumatics1-new.jpg\', \'image/jpeg\', \'\', \'2017-09-25 12:16:14\', \'approval\')', '2017-09-25 12:12:10', 'on'),
(139, 'insert', 'add_product', 'product_details', 46, 6, 'INSERT INTO `product_details` (`prodt_id`, `prodt_category`, `prodt_codeno`, `prodt_name`, `prodt_picture`, `prodt_newpics`, `prodt_description`, `prodt_specifications`, `prodt_price`, `prodt_size`, `prodt_avail_quantity`, `prodt_unite_type`, `prodt_avail_color`, `prodt_brand`, `prodt_offer_type`, `prodt_offer`, `prodt_offer_from`, `prodt_offer_to`, `prodt_offer_times`, `prodt_company_id`, `prodt_fav_count`, `prodt_views_count`, `prodt_offer_views`, `prodt_click_count`, `prodt_ranking`, `prodt_cre`, `prodt_modi`, `prodt_status`) VALUES (NULL, \'{\"194\":{\"cate_parent\":\"Industrial\",\"cate_main\":\"Machinaries\",\"cate_list\":\"Hydraulic & Pnematics\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"183\",\"cate_mid\":\"189\"}}\', \'\', \'Air cylinders \', \'http://dragonmartguide.com/images/products/98_Hydraulic_&_pneumatics.jpg\', \'[\"http:\\/\\/beta.dragonmartguide.com\\/images\\/products\\/99_Hydraulic--&-pneumatics1-new.jpg\"]\', \'<p>The new generation Stanley GT18 Power Unit is the latest in construction site hydraulic power for tools. The GT1 8 conforms to the Hydraulic Tools Manufacturers Association (HTMA) Type 1 and Type 2 tool circuit recommended performance. It will deliver 5 gpm or 8 gpm at pressures up to 2000 psi with heat rejection capacity exceeding the HTMA recommendation of 5 hp. <br /><br />Computerized, electronic throttle control is standard on all models. The control allows for selection of constant engine speed or automatic speed. Automatic speed increases engine speed from idle when it senses tool working demand. When there is no tool working demand, engine speed is returned to idle. The automatic speed mode provides lower fuel use and less noise. <br /><br />All electric control system with rotary switches. All components in the GT18 are assembled for easy routine servicing. The upper frame can be removed for more serious servicing. A quartz hour meter in the control panel records engine run time. <br />The hydraulic pump is mounted directly to the engine eliminating any misalignment and ensuring long life of the drive coupling. An in-tank hydraulic filter continuously cleans the hydraulic fluid and assures that refill fluid passes through the filter for a clean refill. A 35-Ah sealed, non-spillable, no-maintenance battery is located inside a covered compartment. <br /><br />Moving the GT18 around is made easy with a lift-and-latch handle. <br />Both engine models (Briggs or Honda) have pressure lubrication systems with a pressure sensing switch that will shut down the engine if the engine oil level is too low. <br />Some GT18 models are available with 110 vac, 60 Hz electric power provided by a Briggs &amp; Stratton PowerLink inverter system. This system will deliver 1000 watts, continuous and 1500 watts in termittent power through GFCI receptacles.</p>\r\n<p><strong>Features:</strong></p>\r\n<p><br />&bull; Application of new seal material and buffer structure <br />&bull; Low start pressure <br />&bull; Stable operation <br />&bull; Fine tightness <br />&bull; Long service life <br />&bull; Head and rear cover are specially electrophoresis-coated <br />&bull; Beautiful appearance <br />&bull; Widely used in automatic devices, e.g. light industry, chemical industry, textile, electron, machinery, etc<br />&nbsp;</p>\', \'<p>Standard or Nonstandard: Standard<br />Structure: Piston Cylinder<br />Power: Pneumatic<br />Body Material: Aluminum<br />Maximum Stroke: 50mm<br />Shaft Diameter: 50mm<br />Place of Origin: Zhejiang, China (Mainland)<br />Model Number: SCF50X50<br />Brand Name: YONGYI<br />Quality System Certification: ISO9001:2008 and CE Certification<br />Quality control: 7 technicials of QA,QC,QE.<br />Sample: Free of charge<br />Working Pressure: 0.15~1.0Mpa<br />Fluid: 40 micron filtered air<br />Medium and Ambinent Temperature: 5~60Ã¢â€žÆ’<br />Compression Pressure: 1.5Mpa<br />Operating Piston Speed Range: 100~500mm/s<br />Durability: &le;300</p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'830\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-25 12:23:39\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-25 12:23:39', 'on'),
