(141, 'insert', 'add_product', 'product_details', 47, 6, 'INSERT INTO `product_details` (`prodt_id`, `prodt_category`, `prodt_codeno`, `prodt_name`, `prodt_picture`, `prodt_newpics`, `prodt_description`, `prodt_specifications`, `prodt_price`, `prodt_size`, `prodt_avail_quantity`, `prodt_unite_type`, `prodt_avail_color`, `prodt_brand`, `prodt_offer_type`, `prodt_offer`, `prodt_offer_from`, `prodt_offer_to`, `prodt_offer_times`, `prodt_company_id`, `prodt_fav_count`, `prodt_views_count`, `prodt_offer_views`, `prodt_click_count`, `prodt_ranking`, `prodt_cre`, `prodt_modi`, `prodt_status`) VALUES (NULL, \'{\"196\":{\"cate_parent\":\"Industrial\",\"cate_main\":\"Warehousing & Handling\",\"cate_list\":\"Storage\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"183\",\"cate_mid\":\"195\"}}\', \'\', \'storage\', \'http://dragonmartguide.com/images/products/100_storage.jpg\', \'\', \'<p>Housing single/dual expander (field upgradable) modules, dual fans and redundant power supply in short-depth design provides full redundancy and high availability for critical, performance driven storage demand. The combination of LSI expander chip and AIC\\\'s own firmware is a guarantee of compatibility with most mainstream hard drives, HBAs and RAID controllers (SAS2/SAS3).</p>\r\n<p><br /><strong>Key Features:</strong></p>\r\n<p><br />&bull; Intelligent Enclosure Management<br />&bull; Individual drive power management<br />&bull; Cutting edge performance and scalability<br />&bull; External port self-configuration to host or expansion<br />&bull; Supports SES-2 (SCSI Enclosure Service)<br />&bull; Hot swap design for easy maintenance and management<br />&bull; Adjustable Thermal Profile<br />&bull; Easy deployment</p>\', \'<p><strong>General</strong><br />Number of Expander: Single/Dual<br />Expander Chip: LSI SAS3x28R<br />Host/Expansion Interface : 3 x Mini SAS HD (SFF-8644) per expander tray<br /><br /><strong>Drives Supported</strong><br /><br />Drive Interface:<br />&bull; 12Gb &amp; 6Gb SAS if using dual expanders<br />&bull; 12Gb &amp; 6Gb SAS/SATA if using single expander<br />Form Factor: 3.5&rdquo;<br /><br />Administration / Management<br /><br />Admin/Firmware Upgrade:<br />&bull; In-band &amp; Serial port interface<br />&bull; Intelligent Enclosure Management port (optional)<br />LED Indicators, Audible Alarm: Yes<br /><br /><strong>Hot swap &amp; Redundancy</strong><br /><br />Disk Drive: Hot swap 16-bay<br />Cooling: 2 x 8038 hot swap fans<br />Power Supply: 549W 1+1 hot-swap redundant 80+ Platinum<br />Power Entry: Dual AC Inlet<br />Expander: Dual expanders<br /><br /><strong>Electrical &amp; Environment</strong><br /><br />Universal A/C Input: 100~240V AC full range<br />Operating Environment:<br />&bull; Temperature 0&ordm;C to 35&ordm;C<br />&bull; Relative humidity 20% to 80%<br />Non-operating Environment:<br />&bull; Temperature -20&ordm;C to 60&ordm;C<br />&bull; Relative humidity 10% to 90%<br /><br /><strong>Physical Specification</strong><br /><br />Dimensions (W x D x H) (with chassis ears):<br />&bull; mm: 483 x 534 x 131<br />&bull; inches: 19 x 21 x 5.2<br />Gross Weight (w/ PSU; w/o Rail &amp; Disks):<br />&bull; kgs: 24.8<br />&bull; lbs: 54.6<br />Packaging Dimension (W x D x H):<br />&bull; mm: 595 x 785 x 338<br />&bull; inches: 23.4 x 31 x 13.3<br />Mounting:<br />&bull; Standard: Adjustable plate<br />&bull; Option: 20&rdquo; tool-less rail</p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'706\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-25 12:34:33\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-25 12:34:33', 'on'),
