, Easy to maintain and Service , Gross Power 57 hp<br />2) Transmission:- Heavy Duty, High Capacity and proven transmission with 8 forward and 2 reverse speed.<br />3) Axles:- Front axle &ndash; Steering axle with 16 degree Oscillation for maximum ground Contact. Tough rigid rear axle.<br />4) Hydraulics:- Filtration trough special designed suction strainer and return line filter.<br />5) Steering:- Hydrostatic control for reliability, better control and quick response.<br />6) Loader Performance: 2930mm/ 9&rsquo;7&rdquo; dump height give extra ordinary loading benefits.<br />7) CAB:- Fully adjustable seat, better controls give extra comfort for long working <br /><br /></p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'830\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-25 13:20:38\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-25 13:20:38', 'on'),
