rn button, rc drone will automatically come back to you. <br />&bull;&nbsp;&nbsp;&nbsp; [SERVICE GUARANTEE]: Please note EACHINE only sells BRAND NEW products. If you found that the box tape was teared down or some accessories was missing in package when you received the item, please don\\\'t worry, we have tested our product before shipment in order to ensure the products are in good condition. If you have any problem about product, please do not hesitate to contact us, we will try our best to help<br /></span></p>\', \'\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'593\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-25 15:38:54\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-25 15:38:54', 'on'),
