(237, 'insert', 'add_product', 'product_details', 76, 6, 'INSERT INTO `product_details` (`prodt_id`, `prodt_category`, `prodt_codeno`, `prodt_name`, `prodt_picture`, `prodt_newpics`, `prodt_description`, `prodt_specifications`, `prodt_price`, `prodt_size`, `prodt_avail_quantity`, `prodt_unite_type`, `prodt_avail_color`, `prodt_brand`, `prodt_offer_type`, `prodt_offer`, `prodt_offer_from`, `prodt_offer_to`, `prodt_offer_times`, `prodt_company_id`, `prodt_fav_count`, `prodt_views_count`, `prodt_offer_views`, `prodt_click_count`, `prodt_ranking`, `prodt_cre`, `prodt_modi`, `prodt_status`) VALUES (NULL, \'{\"100\":{\"cate_parent\":\"Electricals \",\"cate_main\":\"industrial equipments \",\"cate_list\":\"welding and lathe\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"81\",\"cate_mid\":\"96\"}}\', \'\', \'Electric mig welding machine\', \'http://dragonmartguide.com/images/products/133_Welding_and_lathe.jpg\', \'[\"http:\\/\\/beta.dragonmartguide.com\\/images\\/products\\/134_Welding_and_lathe1.jpg\"]\', \'<p>Manual arc welding machine are widely used in automobile maintenance, building decoration, installation of doors and windows industry, power station auxiliary installation, billboards and other fields with the advantages of small volume, simple operation, convenient use, fast speed and strong welding advantages.</p>\', \'<p>Condition: New<br />Place of Origin: Shandong, China (Mainland)<br />Brand Name: Riland<br />Model Number: ZX7-500GT<br />Pulse Frequency: 50/60 HZ<br />Rated Duty Cycle: 85%<br />Motor Type: AC Motor<br />Dimensions: 535x272x463mm<br />Usage: Welding<br />Voltage: 380V<br />Certification: CE CCC<br />Warranty: 1 Year<br />After-sales Service Provided: Engineers available to service machinery overseas<br />Name: Electric mig welding machine specification<br />Input frequency(Hz): 50/60<br />Current /voltage regulation range(A/V): 40-480<br />Thrust adjustment range(A): 0-100<br />No-load voltage(V): 68<br />No-load loss(W): 80<br />Efficiency(%): 85<br />Power factor: 0.93</p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'478\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-26 09:13:26\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-26 09:13:26', 'on'),
