(239, 'update', '', 'product_details', 75, 6, 'UPDATE `product_details` SET `prodt_category` = \'{\"251\":{\"cate_parent\":\"Furniture\",\"cate_main\":\"Home & Garden Furniture\",\"cate_list\":\"Rugs & Carpets\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"137\",\"cate_mid\":\"138\"}}\', `prodt_name` = \'Carpets\', `prodt_picture` = \'http://dragonmartguide.com/images/products/132_rugs_and_carpets1.jpg\', `prodt_newpics` = \'[\"http:\\/\\/beta.dragonmartguide.com\\/images\\/products\\/138_rugs-and-carpets.jpg\"]\', `prodt_description` = \'<p>As definition of oriental the these rugs come from eastern (Asian) traditional carpet manufacturer countries like china, vietnam and India including persia. These are hand knotted or hand woven manufactured with wool pile some time without pile. On account of durabily Orintal rugs are useful for 50-80 year without loosing its beauty and attraction. These carpets are woven very tightly weaving&nbsp; one by one knot by the weavers using wool on cotton foundation. That is why these rugs can serve for 50-80 year with beauty, charm and luster. In term of expenses these carpets are very expensive. Oriental carpets are made from expensive materials like high grade New Zealand Wool and cotton yarn except materials the weaving charges of oriental rugs are high. On account of beauty there is no alternate of oriental rug.</p>\', `prodt_specifications` = \'\', `prodt_size` = \'\', `prodt_avail_quantity` = \'\', `prodt_unite_type` = \'\', `prodt_avail_color` = \'\', `prodt_brand` = \'\', `prodt_modi` = \'2017-09-26 09:15:41\', `prodt_status` = \'approval\' WHERE `product_details`.`prodt_id` = \'75\'', '2017-09-26 09:15:41', 'on'),
