>&bull;&nbsp;&nbsp;&nbsp; MFG Part: PS-1250<br />&bull;&nbsp;&nbsp;&nbsp; SKU: 3295149</p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'625\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-26 10:29:00\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-26 10:29:00', 'on'),
