(279, 'insert', 'add_product', 'product_details', 89, 6, 'INSERT INTO `product_details` (`prodt_id`, `prodt_category`, `prodt_codeno`, `prodt_name`, `prodt_picture`, `prodt_newpics`, `prodt_description`, `prodt_specifications`, `prodt_price`, `prodt_size`, `prodt_avail_quantity`, `prodt_unite_type`, `prodt_avail_color`, `prodt_brand`, `prodt_offer_type`, `prodt_offer`, `prodt_offer_from`, `prodt_offer_to`, `prodt_offer_times`, `prodt_company_id`, `prodt_fav_count`, `prodt_views_count`, `prodt_offer_views`, `prodt_click_count`, `prodt_ranking`, `prodt_cre`, `prodt_modi`, `prodt_status`) VALUES (NULL, \'{\"111\":{\"cate_parent\":\"Electricals \",\"cate_main\":\"power and energy products \",\"cate_list\":\"Solar Power Plant products \",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"81\",\"cate_mid\":\"108\"}}\', \'\', \'Solar Panels\', \'http://dragonmartguide.com/images/products/163_solar_power_plant_products.jpg\', \'[\"http:\\/\\/beta.dragonmartguide.com\\/images\\/products\\/164_solar_power_plant_products1.jpg\"]\', \'<p><strong>Detailed Information</strong><br /><br /><strong>Solartech J-Series Modules</strong> <br /><br />Solartech photovoltaic J-Series Modules are constructed with high efficient polycrystalline solar cells and produce higher output per module than others in it class. This industrial grade module is an industry standard among various industry professionals.</p>\r\n<p><br /><strong>Features</strong><br />&bull;&nbsp;&nbsp;&nbsp; Class 1, Division 2, (C1D2) Group A,B,C and D<br />&bull;&nbsp;&nbsp;&nbsp; Accessible junction box with 4-1/2\\\" knockout for ease of installation. <br />&bull;&nbsp;&nbsp;&nbsp; (EVA) with TPT cushions the solar cells within the laminate an ensures the operating characteristics of the solar cells under virtually any climatic condition<br />&bull;&nbsp;&nbsp;&nbsp; Rigid anodized aluminum frame and low iron tempered glass <br />&bull;&nbsp;&nbsp;&nbsp; Easily accessible grounding points on all four corners for fast installation<br />&bull;&nbsp;&nbsp;&nbsp; Proven junction box technology<br /><br /><strong>Applications</strong><br />&bull;&nbsp;&nbsp;&nbsp; Traffic &amp; Safety<br />&bull;&nbsp;&nbsp;&nbsp; Federal Government<br />&bull;&nbsp;&nbsp;&nbsp; Oil &amp; Gas<br />&bull;&nbsp;&nbsp;&nbsp; Security<br />&bull;&nbsp;&nbsp;&nbsp; Telecommunications<br />&bull;&nbsp;&nbsp;&nbsp; Water and Wastewater<br />&bull;&nbsp;&nbsp;&nbsp; Weather &amp; Environmental Monitoring<br />&bull;&nbsp;&nbsp;&nbsp; RV Camper<br />&bull;&nbsp;&nbsp;&nbsp; Emergency Power<br />&bull;&nbsp;&nbsp;&nbsp; Telemetry<br />&bull;&nbsp;&nbsp;&nbsp; SCADA, RTU, GPS<br />&bull;&nbsp;&nbsp;&nbsp; Marine<br />&bull;&nbsp;&nbsp;&nbsp; Area Lighting &amp; Sign<br /><br /><strong>Solartech Solar Panel Ordering Guideline</strong><br /><br />Example Model NoÃ¯Â¼Å¡ SPM005P-R-A <br />1. Solartech Modules Series <br />2. Cell type: <br />PÃ¯Â¼Å¡ Polycrystal <br />M: monocrystal <br />RÃ¯Â¼Å¡ Aluminum Frame (equal or less than 30W) <br />DÃ¯Â¼Å¡ Picture Frame (equal or less than 30W) <br />AÃ¯Â¼Å¡ Cable is 3M, no Ring connector(equal or less than 30W) <br />NÃ¯Â¼Å¡ Cable is 1M, no Ring connector(equal or less than 30W) <br />FÃ¯Â¼Å¡ 4 hole J-BOX no cable;not perforated <br />F4Ã¯Â¼Å¡ 4 hole J-BOX +MC4 connector <br />F3Ã¯Â¼Å¡ 4 hole J-BOX +MC3 connector <br />L1Ã¯Â¼Å¡ 4 hole J-BOX no cable;open-hole at left <br />R1Ã¯Â¼Å¡ 4 hole J-BOX no cable;open-hole at right <br />LRÃ¯Â¼Å¡ 4 hole J-BOX no cable;open-hole at right and left <br />D2Ã¯Â¼Å¡ 4 hole J-BOX no cable;two hole at down <br />TSÃ¯Â¼Ë†NÃ¯Â¼â€°Ã¯Â¼Å¡ normal size (currently just used in SPM080P-TS) <br />TLÃ¯Â¼Å¡ long type size (currently just used in SPM080P-TL) <br />WP: 33V solar module ,application voltage is 24V <br />SÃ¯Â¼Å¡ Small size than normal </p>\', \'<p>Class 1 Division 2 compliant. <br />Model &nbsp;&nbsp;&nbsp; :SPM050P-BP <br />Series :&nbsp;&nbsp;&nbsp; J-Series <br />Manufacturer :&nbsp;&nbsp;&nbsp; Solartech<br /><strong>&nbsp;</strong><br /><strong>Mechanical</strong><br />Type &nbsp;&nbsp;&nbsp; :Poly <br />Dimensions &nbsp;&nbsp;&nbsp; :32.8\\\" x 21.2\\\" x 1.97\\\" <br />Weight &nbsp;&nbsp;&nbsp; :13.42 lbs <br />Frame &nbsp;&nbsp;&nbsp; :Anodized aluminum <br />Connector Junction Box - with 4-1/2\\\" knockout for ease of installation <br /><br /><strong>Electrical</strong><br />Watts (STC) :&nbsp;&nbsp;&nbsp; 50 W <br />Max Power Voltage (VMPP) &nbsp;&nbsp;&nbsp; :17.5 V <br />Max Power Current (IMPP) &nbsp;&nbsp;&nbsp; :2.9 A <br />Open Circuit Voltage (VOC) &nbsp;&nbsp;&nbsp; :21.8 V <br />Short Circuit Current (ISC) &nbsp;&nbsp;&nbsp; :3.2 A <br />Max System Voltage (UL) &nbsp;&nbsp;&nbsp; :DC 600 V <br /><br /><strong>Warranty</strong><br />&bull;&nbsp;&nbsp;&nbsp; 12 Years, 90% output<br />&bull;&nbsp;&nbsp;&nbsp; 25 years, 80% output<br />&bull;&nbsp;&nbsp;&nbsp; 5-year limited warranty of materials and worksmanship</p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'516\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-26 10:38:44\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-26 10:38:44', 'on'),
