(286, 'insert', 'add_product', 'product_details', 91, 6, 'INSERT INTO `product_details` (`prodt_id`, `prodt_category`, `prodt_codeno`, `prodt_name`, `prodt_picture`, `prodt_newpics`, `prodt_description`, `prodt_specifications`, `prodt_price`, `prodt_size`, `prodt_avail_quantity`, `prodt_unite_type`, `prodt_avail_color`, `prodt_brand`, `prodt_offer_type`, `prodt_offer`, `prodt_offer_from`, `prodt_offer_to`, `prodt_offer_times`, `prodt_company_id`, `prodt_fav_count`, `prodt_views_count`, `prodt_offer_views`, `prodt_click_count`, `prodt_ranking`, `prodt_cre`, `prodt_modi`, `prodt_status`) VALUES (NULL, \'{\"116\":{\"cate_parent\":\"Lifestyle \",\"cate_main\":\"fashion \",\"cate_list\":\"Apparel\",\"cate_subcategory\":\"999\",\"cate_level\":\"3\",\"cate_pid\":\"112\",\"cate_mid\":\"113\"}}\', \'\', \'Jackets\', \'http://dragonmartguide.com/images/products/168_Apparel.JPG\', \'[\"http:\\/\\/beta.dragonmartguide.com\\/images\\/products\\/169_Apparel1.JPG\"]\', \'<p>A real favorite among the crew during last summers field-testing. The Alta Wind shirt is a hybrid between a shirt and an outshell windbreaker.</p>\r\n<p><br /><strong>Details:</strong></p>\r\n<p><br />Manufactured from strong Nylon fabric, it&rsquo;s designed with a roomy fit and a full-length zipper in the front. This shirt is soft enough to be worn straight next to the skin, yet wind-, UV- and mosquito-proof.<br /><br />On either side of the chest are external top entry-pockets with push button closure. They are large enough to hold trout-sized fly boxes. There is also a pen/sunglass pocket on the right side and a further vertical pocket with zipper closure on the left chest. There are D-rings in the neck and under the lid of the left side chest pocket. There is a ventilating mesh panel in the back of the shoulders and the sleeves have hidden roll-up fixtures. </p>\', \'<p>Fabric: 100% Nylon.<br />Color: Clear Blue, Charcoal.<br />Weight: 224 grams in size L.<br />Sizes: S &ndash; XXXL.</p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'1280\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-26 10:49:16\', \'0000-00-00 00:00:00\', \'approval\')', '2017-09-26 10:49:16', 'on'),
