 <br />&bull;&nbsp;&nbsp;&nbsp; 1 rock climbing wall with rock grips&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 1 telescope&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 1 steering wheel&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 2 safety handles </p>\', \'<p>Construction &amp; Specifications:<br />&bull;&nbsp;&nbsp;&nbsp; This unit is for residential use only&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Constructed with 100% redwood, stained for lasting richness&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 5\\\' x 5\\\' play deck with 5\\\' deck height&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 5\\\' x 5\\\' play deck with 7\\\' deck height&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 3\\\' x 5\\\' balcony with 5\\\' deck height&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Sturdy 4\\\" x 6\\\" deck supports with 2\\\" x 6\\\" decking&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Solid 4\\\" x 4\\\" frame design with 4\\\" x 6\\\" swing beam rated at 250 lbs. per swing&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Spacious 3-position swing beam for safe swinging&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Commercial-grade swing hangers with safety clips for adjustability&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Heavy-duty, 1-piece molded swing belts with reinforced nylon grommets &amp; UV protection to resist fading; matching plastisol coated \\\'pinch-free\\\' chains that stay cool to the touch and won\\\'t fray or rust&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; 100% nut/bolt and screw construction. No nails or staples&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Safety step ladder, inclined with wide flat 2\\\" x 6\\\" ladder steps&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Made in the USA&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Recommended for ages 3 - 11&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Overall dimensions 34\\\' L x 15\\\' W x 13\\\' H&nbsp; <br />&bull;&nbsp;&nbsp;&nbsp; Approximate weight 1,773 lbs.</p>\', \'0\', \'\', \'\', \'\', \'\', \'\', \'\', \'\', \'0000-00-00 00:00:00\', \'0000-00-00 00:00:00\', \'0\', \'1122\', \'0\', \'0\', \'0\', \'0\', \'\', \'2017-09-2